B.Lb=new A.d(B.c,["\u0905\u0936\u094d\u0930\u0926\u094d\u0926\u0927\u093e\u0928\u093e\u0903 \u092a\u0941\u0930\u0941\u0937\u093e\u0903 \u0927\u0930\u094d\u092e\u0938\u094d\u092f \u0905\u0938\u094d\u092f \u092a\u0930\u0928\u094d\u0924\u092a \u0964\n\u0905\u092a\u094d\u0930\u093e\u092a\u094d\u092f \u092e\u093e\u092e\u094d \u0928\u093f\u0935\u0930\u094d\u0924\u0928\u094d\u0924\u0947 \u092e\u0943\u0924\u094d\u092f\u0941 \u0938\u092e\u094d\u0938\u093e\u0930 \u0935\u0930\u094d\u0924\u094d\u092e\u0928\u093f \u0965 \u0969 \u0965","O destroyer of enemies, people who do not believe in this practice don\u2019t attain Me. They return to this material world, which is always subject to death and destruction."],t.w)
