B.Qi=new A.d(B.c,["\u091c\u094d\u091e\u093e\u0928\u092f\u091c\u094d\u091e\u0947\u0928 \u091a\u093e\u092a\u094d\u092f\u0928\u094d\u092f\u0947 \u092f\u091c\u0928\u094d\u0924\u094b \u092e\u093e\u092e\u094d \u0909\u092a\u093e\u0938\u0924\u0947 \u0964\n\u090f\u0915\u0924\u094d\u0935\u0947\u0928 \u092a\u0943\u0925\u0915\u094d\u0924\u094d\u0935\u0947\u0928 \u092c\u0939\u0941\u0927\u093e \u0935\u093f\u0936\u094d\u0935\u0924\u094b\u092e\u0941\u0916\u092e\u094d \u0965 \u0967\u096b \u0965","Yet others worship through study. They worship Me in the form of a single person having the universe as His form, appearing in many different ways."],t.w)
B.PM=new A.d(B.c,["\u0905\u0939\u092e\u094d \u0915\u094d\u0930\u0924\u0941\u0930\u0939\u092e\u094d \u092f\u091c\u094d\u091e\u0903 \u0938\u094d\u0935\u0927\u093e \u0905\u0939\u092e\u094d \u0905\u0939\u092e\u094d \u0914\u0937\u0927\u092e\u094d \u0964\n\u092e\u0928\u094d\u0924\u094d\u0930\u094b \u0905\u0939\u092e\u094d \u0905\u0939\u092e\u094d \u090f\u0935 \u0906\u091c\u094d\u092f\u092e\u094d \u0905\u0939\u092e\u094d \u0905\u0917\u094d\u0928\u093f\u0930\u0939\u092e\u094d \u0939\u0941\u0924\u092e\u094d \u0965 \u0967\u096c \u0965","I am the inspiration and the ceremony. I am worship. I am the offering given to elders. I am the preparation that's offered. I am the chant. I am the one who fuels the fire. I am the fire. I am the One into which the offering is made."],t.w)
B.NN=new A.d(B.c,["\u092a\u093f\u0924\u093e \u0905\u0939\u092e\u094d \u0905\u0938\u094d\u092f \u091c\u0917\u0924\u094b \u092e\u093e\u0924\u093e \u0927\u093e\u0924\u093e \u092a\u093f\u0924\u093e\u092e\u0939\u0903 \u0964\n\u0935\u0947\u0926\u094d\u092f\u092e\u094d \u092a\u0935\u093f\u0924\u094d\u0930\u092e\u094d \u0913\u092e\u094d\u0915\u093e\u0930\u0903 \u090b\u0915\u094d \u0938\u093e\u092e \u092f\u091c\u0941\u0930\u0947\u0935 \u091a \u0965 \u0967\u096d \u0965","I am the father of this world, the mother, the founder, the bearer, the grandfather. Indeed, I am the auspicious knowledge in the Vedas, the sound of Om, the Rig, Sama and Yajur Vedas."],t.w)
B.IT=new A.d(B.c,["\u0917\u0924\u093f\u0930\u094d\u092d\u0930\u094d\u0924\u093e \u092a\u094d\u0930\u092d\u0941\u0903 \u0938\u093e\u0915\u094d\u0937\u0940 \u0928\u093f\u0935\u093e\u0938\u0903 \u0936\u0930\u0923\u092e\u094d \u0938\u0941\u0939\u0943\u0924\u094d \u0964\n\u092a\u094d\u0930\u092d\u0935 \u092a\u094d\u0930\u0932\u092f \u0938\u094d\u0925\u093e\u0928\u092e\u094d \u0928\u093f\u0927\u093e\u0928\u092e\u094d \u092c\u0940\u091c\u092e\u094d \u0905\u0935\u094d\u092f\u092f\u092e\u094d \u0965 \u0967\u096e \u0965","The goal, the bearer, the Lord, the one who sees everything directly, a place to live in, the refuge, the well-wisher, the place in which creation and destruction occur, an investment, the seed, which does not wear out."],t.w)
B.Q2=new A.d(B.c,["\u0924\u092a\u093e\u092e\u094d\u092f\u0939\u092e\u094d \u0905\u0939\u092e\u094d \u0935\u0930\u094d\u0937 \u0928\u093f\u0917\u0943\u0939\u094d\u0923\u093e\u092e\u093f \u0909\u0924\u094d\u0938\u0943\u091c\u093e\u092e\u093f \u091a \u0964\n\u0905\u092e\u0943\u0924\u092e\u094d \u091a\u0948\u0935 \u092e\u0943\u0924\u094d\u092f\u0941\u0903 \u091a \u0938\u0926\u0938\u0924\u094d \u091a \u0905\u0939\u092e\u094d \u0905\u0930\u094d\u091c\u0941\u0928 \u0965 \u0967\u096f \u0965","Arjuna, I give rise to heat I restrict rain and make it pour too. I am life itself, I am death, I am the real and the imaginary."],t.w)
B.NQ=new A.d(B.c,["\u0924\u094d\u0930\u0948\u0935\u093f\u0926\u094d\u092f\u093e \u092e\u093e\u092e\u094d \u0938\u094b\u092e\u092a\u093e\u0903 \u092a\u0942\u0924\u092a\u093e\u092a\u093e\u0903\n\u092f\u091c\u094d\u091e\u0948\u0930\u093f\u0937\u094d\u091f\u094d\u0935\u093e \u0938\u094d\u0935\u0930\u094d\u0917\u0924\u093f\u092e\u094d \u092a\u094d\u0930\u093e\u0930\u094d\u0925\u092f\u0928\u094d\u0924\u0947 \u0964\n\u0924\u0947 \u092a\u0941\u0923\u094d\u092f\u092e\u093e\u0938\u093e\u0926\u094d\u092f \u0938\u0941\u0930\u0947\u0928\u094d\u0926\u094d\u0930 \u0932\u094b\u0915\u092e\u094d\n\u0905\u0936\u094d\u0928\u0928\u094d\u0924\u093f \u0926\u093f\u0935\u094d\u092f\u093e\u0928\u094d \u0926\u093f\u0935\u093f \u0926\u0947\u0935-\u092d\u094b\u0917\u093e\u0928\u094d \u0965 \u0968\u0966 \u0965\n\u0924\u0947 \u0924\u092e\u094d \u092d\u0941\u0915\u094d\u0924\u094d\u0935\u093e \u0938\u094d\u0935\u0930\u094d\u0917 \u0932\u094b\u0915\u092e\u094d \u0935\u093f\u0936\u093e\u0932\u092e\u094d\n\u0915\u094d\u0937\u0940\u0923\u0947 \u092a\u0941\u0923\u094d\u092f\u0947 \u092e\u0930\u094d\u0924\u094d\u092f \u0932\u094b\u0915\u092e\u094d \u0935\u093f\u0936\u0928\u094d\u0924\u093f \u0964\n\u090f\u0935\u092e\u094d \u0924\u094d\u0930\u092f\u0940 \u0927\u0930\u094d\u092e\u092e\u094d \u0905\u0928\u0941\u092a\u094d\u0930\u092a\u0928\u094d\u0928\u093e\u0903\n\u0917\u0924\u093e\u0917\u0924\u092e\u094d \u0915\u093e\u092e\u0915\u093e\u092e\u093e \u0932\u092d\u0928\u094d\u0924\u0947 \u0965 \u0968\u0967 \u0965","Those who know the three Vedas worship Me with ceremonies, consume the residue from the ceremony and get rid of their misfortune. They pray for a world of comforts. Having arrived in the world of comforts, they enjoy divine pleasures of the elite in that world. Having enjoyed the vast world of comforts, they enter the world of ordinary humans once their virtues are spent. In this way, people who crave for desirable things and advocate the three Vedas to gain these ends keep going and coming back."],t.w)
B.Kw=new A.d(B.c,["\u0905\u0928\u0928\u094d\u092f\u093e\u0903 \u091a\u093f\u0928\u094d\u0924\u092f\u0928\u094d\u0924\u094b \u092e\u093e\u092e\u094d \u092f\u0947 \u091c\u0928\u093e\u0903 \u092a\u0930\u094d\u092f\u0941\u092a\u093e\u0938\u0924\u0947 \u0964\n\u0924\u0947\u0937\u093e\u092e\u094d \u0928\u093f\u0924\u094d\u092f\u093e\u092d\u093f\u092f\u0941\u0915\u094d\u0924\u093e\u0928\u093e\u092e\u094d \u092f\u094b\u0917 \u0915\u094d\u0937\u0947\u092e\u092e\u094d \u0935\u0939\u093e\u092e\u094d\u092f\u0939\u092e\u094d \u0965 \u0968\u0968 \u0965","The people who worship Me constantly while having Me in their thoughts, without having any other objective in mind desire to be united with Me forever. I take care of their achievements and the preservation of what they have achieved."],t.w)
B.OI=new A.d(B.c,["\u092f\u0947 \u0924\u0941 \u0905\u0928\u094d\u092f \u0926\u0947\u0935\u0924\u093e \u092d\u0915\u094d\u0924\u093e\u0903 \u092f\u091c\u0928\u094d\u0924\u0947 \u0936\u094d\u0930\u0926\u094d\u0927\u092f\u093e\u093d\u0928\u094d\u0935\u093f\u0924\u093e\u0903 \u0964\n\u0924\u0947\u093d\u092a\u093f \u092e\u093e\u092e\u0947\u0935 \u0915\u094c\u0928\u094d\u0924\u0947\u092f \u092f\u091c\u0928\u094d\u0924\u093f \u0905\u0935\u093f\u0927\u093f\u092a\u0942\u0930\u094d\u0935\u0915\u092e\u094d \u0965 \u0968\u0969 \u0965","On the other hand, those who are devoted to other sources of power worship in complete faith. Even they worship Me alone without following the prescribed rules completely."],t.w)
B.Lu=new A.d(B.c,["\u0905\u0939\u092e\u094d \u0939\u093f \u0938\u0930\u094d\u0935 \u092f\u091c\u094d\u091e\u093e\u0928\u093e\u092e\u094d \u092d\u094b\u0915\u094d\u0924\u093e \u091a \u092a\u094d\u0930\u092d\u0941\u0930\u0947\u0935 \u091a \u0964\n\u0928 \u0924\u0941 \u092e\u093e\u092e\u094d \u0905\u092d\u093f\u091c\u093e\u0928\u0928\u094d\u0924\u093f \u0924\u0924\u094d\u0935\u0947\u0928\u093e\u0924\u0903 \u091a\u094d\u092f\u0935\u0928\u094d\u0924\u093f \u0924\u0947 \u0965 \u0968\u096a \u0965","I am indeed the enjoyer and the single Master of all services rendered to anyone or anything. Those who crave for material wealth do not know Me as I am. Hence, they fall back."],t.w)
B.Kj=new A.d(B.c,["\u092f\u093e\u0928\u094d\u0924\u093f \u0926\u0947\u0935\u0935\u094d\u0930\u0924\u093e \u0926\u0947\u0935\u093e\u0928\u094d\n\u092a\u093f\u0924\u0943\u0928\u094d \u092f\u093e\u0928\u094d\u0924\u093f \u092a\u093f\u0924\u0943\u0935\u094d\u0930\u0924\u093e\u0903 \u0964\n\u092d\u0942\u0924\u093e\u0928\u093f \u092f\u093e\u0928\u094d\u0924\u093f \u092d\u0942\u0924\u0947\u091c\u094d\u092f\u093e\u0903\n\u092f\u093e\u0928\u094d\u0924\u093f \u092e\u0926\u094d\u092f\u093e\u091c\u093f\u0928\u094b\u093d\u092a\u093f \u092e\u093e\u092e\u094d \u0965 \u0968\u096b \u0965","People who dedicate themselves to power will achieve those powers. Those who dedicate themselves to their ancestors join those ancestors. Those who persevere to achieve material gains will attain those materials. People who worship Me with the aim to achieve Me while dedicating themselves to any cause will achieve Me."],t.w)
B.M6=new A.d(B.c,["\u092a\u0924\u094d\u0930\u092e\u094d \u092a\u0941\u0937\u094d\u092a\u092e\u094d \u092b\u0932\u092e\u094d \u0924\u094b\u092f\u092e\u094d \u092f\u094b \u092e\u0947 \u092d\u0915\u094d\u0924\u094d\u092f\u093e \u092a\u094d\u0930\u092f\u091a\u094d\u091b\u0924\u093f \u0964\n\u0924\u0926\u0939\u092e\u094d \u092d\u0915\u094d\u0924\u094d\u092f\u0941\u092a\u0939\u0943\u0924\u092e\u094d \u0905\u0936\u094d\u0928\u093e\u092e\u093f \u092a\u094d\u0930\u092f\u0924\u093e\u0924\u094d\u092e\u0928\u0903 \u0965 \u0968\u096c \u0965","Anyone who offers a leaf, a flower, , a fruit or water to Me with devotion - I will accept whatever is offered with devotion by a person who is so dedicated to Me."],t.w)
B.Qn=new A.d(B.c,["\u092f\u0924\u094d \u0915\u0930\u094b\u0937\u093f \u092f\u0924\u094d \u0905\u0936\u094d\u0928\u093e\u0938\u093f \u091c\u0924\u094d \u091c\u0941\u0939\u094b\u0937\u093f \u0926\u0926\u093e\u0938\u093f \u092f\u0924\u094d \u0964\n\u092f\u0924\u094d \u0924\u092a\u0938\u094d\u092f\u0938\u093f \u0915\u094c\u0928\u094d\u0924\u0947\u092f \u0924\u0924\u094d \u0915\u0941\u0930\u0941\u0937\u094d\u0935 \u092e\u0926\u0930\u094d\u092a\u0923\u092e\u094d \u0965 \u0968\u096d \u0965","Whatever you do, whatever you consume, whatever you sacrifice, whatever you give away, any thought you concentrate on, make it a dedication to Me"],t.w)
B.Pv=new A.d(B.c,["\u0936\u0941\u092d\u093e\u0936\u0941\u092d \u092b\u0932\u0948\u0930\u0947\u0935\u092e\u094d \u092e\u094b\u0915\u094d\u0937\u094d\u092f\u0938\u0947 \u0915\u0930\u094d\u092e \u092c\u0928\u094d\u0927\u0928\u0948\u0903 \u0964\n\u0938\u0902\u0928\u094d\u092f\u093e\u0938 \u092f\u094b\u0917 \u092f\u0941\u0915\u094d\u0924\u093e\u0924\u094d\u092e\u093e \u0935\u093f\u092e\u0941\u0915\u094d\u0924\u094b \u092e\u093e\u092e\u094d \u0909\u092a\u0948\u0937\u094d\u092f\u0938\u093f \u0965 \u0968\u096e \u0965","In this way, you will be free from the bondage of activity with its favorable and unfavorable outcomes. Be with the intent of letting-go. You will be free and attain Me."],t.w)
B.JF=new A.d(B.c,["\u0938\u092e\u094b\u093d\u0939\u092e\u094d \u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u0947\u0937\u0941\n\u0928 \u092e\u0947 \u0926\u094d\u0935\u0947\u0937\u094b\u093d\u0938\u094d\u0924\u093f \u0928 \u092a\u094d\u0930\u093f\u092f\u0903 \u0964\n\u092f\u0947 \u092d\u091c\u0928\u094d\u0924\u093f \u0924\u0941 \u092e\u093e\u092e\u094d \u092d\u0915\u094d\u0924\u094d\u092f\u093e\n\u092e\u092f\u093f \u0924\u0947 \u0924\u0947\u0937\u0941 \u091a\u093e\u092a\u094d\u092f\u0939\u092e\u094d \u0965 \u0968\u096f \u0965","I am equal to all beings. I do not have hatred, neither do I have the attachment of love. However, those who worship Me with devotion are situated in Me, I am within them as well."],t.w)
B.Ls=new A.d(B.c,["\u0905\u092a\u093f \u091a\u0947\u0924\u094d \u0938\u0941\u0926\u0941\u0930\u093e\u091a\u093e\u0930\u094b \u092d\u091c\u0924\u0947 \u092e\u093e\u092e\u094d \u0905\u0928\u0928\u094d\u092f\u092d\u093e\u0915\u094d \u0964\n\u0938\u093e\u0927\u0941\u0930\u0947\u0935 \u0938 \u092e\u0928\u094d\u0924\u0935\u094d\u092f\u0903 \u0938\u092e\u094d\u092f\u0915\u094d \u0935\u094d\u092f\u0935\u0938\u093f\u0924\u094b \u0939\u093f \u0938\u0903 \u0965 \u0969\u0966 \u0965","Even when a very offensive person worships Me with unwavering devotion, he needs to be considered as virtuous indeed. He definitely has the appropriate determination."],t.w)
B.PG=new A.d(B.c,["\u0915\u094d\u0937\u093f\u092a\u094d\u0930\u092e\u094d \u092d\u0935\u0924\u093f \u0927\u0930\u094d\u092e\u093e\u0924\u094d\u092e\u093e \u0936\u0936\u094d\u0935\u0924\u094d \u0936\u093e\u0928\u094d\u0924\u093f\u092e\u094d \u0928\u093f\u0917\u091a\u094d\u091b\u0924\u093f \u0964\n\u0915\u094c\u0928\u094d\u0924\u0947\u092f \u092a\u094d\u0930\u0924\u093f\u091c\u093e\u0928\u0940\u0939\u0940 \u0928 \u092e\u0947 \u092d\u0915\u094d\u0924\u0903 \u092a\u0923\u0936\u094d\u092f\u0924\u093f \u0965 \u0969\u0967 \u0965","Very soon, this person becomes an excellent devotee, who worships Me without flaw. He attains peaceful existence forever. Arjuna, resolve firmly within yourself that My devotee shall not waste away."],t.w)
B.RD=new A.d(B.c,["\u092e\u093e\u092e\u094d \u0939\u093f \u092a\u093e\u0930\u094d\u0925 \u0935\u094d\u092f\u092a\u093e\u0936\u094d\u0930\u093f\u0924\u094d\u092f \u092f\u094b\u093d\u092a\u093f \u0938\u094d\u092f\u0941\u0903 \u092a\u093e\u092a\u092f\u094b\u0928\u092f\u0903 \u0964\n\u0938\u094d\u0924\u094d\u0930\u093f\u092f\u094b \u0935\u0948\u0936\u094d\u092f\u093e\u0903 \u0924\u0925\u093e \u0936\u0942\u0926\u094d\u0930\u093e\u0903 \u0924\u0947\u093d\u092a\u093f \u092f\u093e\u0928\u094d\u0924\u093f \u092a\u0930\u093e\u092e\u094d \u0917\u0924\u093f\u092e\u094d \u0965 \u0969\u0968 \u0965\n\u0915\u093f\u092e\u094d \u092a\u0941\u0928\u0903 \u092c\u094d\u0930\u093e\u0939\u094d\u092e\u0923\u093e\u0903 \u092a\u0941\u0923\u094d\u092f\u093e\u0903 \u092d\u0915\u094d\u0924\u093e \u0930\u093e\u091c\u0930\u094d\u0937\u092f\u0903 \u0924\u0925\u093e \u0964\n\u0905\u0928\u093f\u0924\u094d\u092f\u092e\u094d \u0905\u0938\u0941\u0916\u092e\u094d \u0932\u094b\u0915\u092e\u094d \u0907\u092e\u092e\u094d \u092a\u094d\u0930\u093e\u092a\u094d\u092f \u092d\u091c\u0938\u094d\u0935 \u092e\u093e\u092e\u094d \u0965 \u0969\u0969 \u0965","Arjuna, anyone, irrespective of gender and profession, even those who've tread the path of malice - they will definitely attain the supreme goal after taking refuge in Me. It goes without saying that the same applies to the virtuous, to My devotees, to those who seek to worship and administrators who rule on My behalf. Worship Me, now that you have obtained this world, which is temporary and is devoid of lasting joy."],t.w)
B.Qa=new A.d(B.c,["\u092e\u0928\u094d\u092e\u0928\u093e \u092d\u0935 \u092e\u0926\u094d\u092d\u0915\u094d\u0924\u094b \u092e\u0926\u094d\u092f\u093e\u091c\u0940 \u092e\u093e\u092e\u094d \u0928\u092e\u0938\u094d\u0915\u0941\u0930\u0941 \u0964\n\u092e\u093e\u092e\u094d \u090f\u0935\u0948\u0937\u094d\u092f\u0938\u093f \u092f\u0941\u0915\u094d\u0924\u094d\u0935\u0948\u0935\u092e\u094d \u0906\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u092e\u0924\u094d\u092a\u0930\u093e\u092f\u0923\u0903 \u0965 \u0969\u096a \u0965","Be My devotee, having excessive affection towards me. Keep your mind in Me always. Worship Me alone. Surrender to Me, have Me as your ultimate goal. In this way, by attaching your thoughts to Me, you will certainly attain Me."],t.w)
B.OV=new A.d(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u092d\u0942\u092f \u090f\u0935 \u092e\u0939\u093e\u092c\u093e\u0939\u094b \u0936\u0943\u0923\u0941 \u092e\u0947 \u092a\u0930\u092e\u092e\u094d \u0935\u091a\u0903 \u0964\n\u092f\u0924\u094d \u0924\u0947 \u0905\u0939\u092e\u094d \u092a\u094d\u0930\u0940\u092f\u092e\u093e\u0923\u093e\u092f \u0935\u0915\u094d\u0937\u094d\u092f\u093e\u092e\u093f \u0939\u093f\u0924 \u0915\u093e\u092e\u094d\u092f\u092f\u093e \u0965 \u0967 \u0965","Lord Krishna said - Arjuna, listen to the greatest among My instructions, which I will tell you once again. I\u2019ll do this for you as a friend wishing your well-being."],t.w)
B.Ny=new A.d(B.c,["\u0928 \u092e\u0947 \u0935\u093f\u0926\u0941\u0903 \u0938\u0941\u0930\u0917\u0923\u093e\u0903 \u092a\u094d\u0930\u092d\u0935\u092e\u094d \u0928 \u092e\u0939\u0930\u094d\u0937\u092f\u0903 \u0964\n\u0905\u0939\u092e\u094d \u0906\u0926\u093f\u0930\u094d\u0939\u093f \u0926\u0947\u0935\u093e\u0928\u093e\u092e\u094d \u092e\u0939\u0930\u094d\u0937\u0940\u0923\u093e\u092e\u094d \u091a \u0938\u0930\u094d\u0935\u0937\u0903 \u0965 \u0968 \u0965","Neither the gods nor the great sages know My source. I am indeed the origin of all the gods and the great sages."],t.w)
B.IO=new A.d(B.c,["\u092f\u094b \u092e\u093e\u092e\u094d \u0905\u091c\u092e\u094d \u0905\u0928\u093e\u0926\u093f\u092e\u094d \u091a \u0935\u0947\u0924\u094d\u0924\u093f \u0932\u094b\u0915\u092e\u0939\u0947\u0936\u094d\u0935\u0930\u092e\u094d \u0964\n\u0905\u0938\u092e\u094d\u092e\u0942\u0922\u0903 \u0938 \u092e\u0930\u094d\u0924\u094d\u092f\u0947\u0937\u0941 \u0938\u0930\u094d\u0935\u092a\u093e\u092a\u0948\u0903 \u092a\u094d\u0930\u092e\u0941\u091a\u094d\u092f\u0924\u0947 \u0965 \u0969 \u0965","Among humans, a person who is free of misconceptions knows Me to be without birth and without an origin, the Lord of the universe. Such a person is freed from all misfortune."],t.w)
B.Re=new A.d(B.c,["\u092c\u0941\u0926\u094d\u0927\u093f\u0903 \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0905\u0938\u092e\u094d\u092e\u094b\u0939\u0903 \u0915\u094d\u0937\u092e\u093e \u0938\u0924\u094d\u092f\u092e\u094d \u0926\u092e\u0903 \u0936\u092e\u0903 \u0964\n\u0938\u0941\u0916\u092e\u094d \u0926\u0941\u0903\u0916\u092e\u094d \u092d\u0935\u094b\u093d\u092d\u093e\u0935\u094b \u092d\u092f\u092e\u094d \u091a \u0905\u092d\u092f\u092e\u094d \u090f\u0935 \u091a \u0965 \u096a \u0965\n\u0905\u0939\u093f\u092e\u094d\u0938\u093e \u0938\u092e\u0924\u093e \u0924\u0941\u0937\u094d\u091f\u093f\u0903 \u0924\u092a\u094b \u0926\u093e\u0928\u092e\u094d \u092f\u0936\u094b\u093d\u092f\u0936\u0903 \u0964\n\u092d\u0935\u0928\u094d\u0924\u093f \u092d\u093e\u0935\u093e \u092d\u0942\u0924\u093e\u0928\u093e\u092e\u094d \u092e\u0924\u094d\u0924 \u090f\u0935 \u092a\u0943\u0925\u0915\u094d \u0935\u093f\u0927\u093e\u0903 \u0965 \u096b \u0965","The various emotions that take place in all beings arise from Me alone - recognition, cognition, freedom from misconception, forgiveness, truth, control over voluntary actions, control over oneself, comfort, discomfort, the state of having plenty, the state of discontent, fear and fearlessness too, the desire to avoid harming anyone, the attitude of equanimity, contentment, focus, charity, fame and infamy."],t.w)
B.NC=new A.d(B.c,["\u092e\u0939\u0930\u094d\u0937\u092f\u0903 \u0938\u092a\u094d\u0924 \u092a\u0942\u0930\u094d\u0935\u0947 \u091a\u0924\u094d\u0935\u093e\u0930\u094b \u092e\u0928\u0935\u0938\u094d\u0924\u0925\u093e \u0964\n\u092e\u0926\u094d\u092d\u093e\u0935\u093e \u092e\u093e\u0928\u0938\u093e \u091c\u093e\u0924\u093e\u0903 \u092f\u0947\u0937\u093e\u092e\u094d \u0932\u094b\u0915\u0947 \u0907\u092e\u093e\u0903 \u092a\u094d\u0930\u091c\u093e\u0903 \u0965 \u096c \u0965","The seven great sages, our ancestors born of Brahma, along with the four Manus are an expression of My will. All these descendants from them live in this world."],t.w)
B.R2=new A.d(B.c,["\u090f\u0924\u093e\u092e\u094d \u0935\u093f\u092d\u0942\u0924\u093f\u092e\u094d \u092f\u094b\u0917\u092e\u094d \u091a \u092e\u092e \u092f\u094b \u0935\u0947\u0924\u094d\u0924\u093f \u0924\u0924\u094d\u0924\u094d\u0935\u0924\u0903 \u0964\n\u0938\u0903 \u0905\u0935\u093f\u0915\u092e\u094d\u092a\u094d\u092f\u0947\u0928 \u092f\u094b\u0917\u0947\u0928 \u092f\u0941\u091c\u094d\u092f\u0924\u0947 \u0928\u093e\u0924\u094d\u0930 \u0938\u092e\u094d\u0936\u092f\u0903 \u0965 \u096d \u0965","The person who knows this expanse of My unlimited power and My associations - such a person sets to work and performs with unwavering focus and discipline. Let there be no doubt about this."],t.w)
B.Pr=new A.d(B.c,["\u0905\u0939\u092e\u094d \u0938\u0930\u094d\u0935\u0938\u094d\u092f \u092a\u094d\u0930\u092d\u0935\u094b \u092e\u0924\u094d\u0924\u0903 \u0938\u0930\u094d\u0935\u092e\u094d \u092a\u094d\u0930\u0935\u0930\u094d\u0924\u0924\u0947 \u0964\n\u0907\u0924\u093f \u092e\u0924\u094d\u0935\u093e \u092d\u091c\u0928\u094d\u0924\u0947 \u092e\u093e\u092e\u094d \u092c\u0941\u0927\u093e \u092d\u093e\u0935 \u0938\u092e\u0928\u094d\u0935\u093f\u0924\u093e\u0903 \u0965 \u096e \u0965","People with this awareness worship Me with the conviction that I am the origin of everything; that every entity gets stimulated with the initiative given by Me. These people are filled with feelings of adoration for Me."],t.w)
B.OE=new A.d(B.c,["\u092e\u091a\u094d\u091a\u093f\u0924\u094d\u0924\u093e \u092e\u0926\u094d\u0917\u0924 \u092a\u094d\u0930\u093e\u0923\u093e\u0903 \u092c\u094b\u0927\u092f\u0928\u094d\u0924\u0903 \u092a\u0930\u0938\u094d\u092a\u0930\u092e\u094d \u0964\n\u0915\u0925\u092f\u0928\u094d\u0924\u0903 \u091a \u092e\u093e\u092e\u094d \u0928\u093f\u0924\u094d\u092f\u092e\u094d \u0924\u0941\u0937\u094d\u092f\u0928\u094d\u0924\u093f \u091a \u0930\u092e\u0928\u094d\u0924\u093f \u091a \u0965 \u096f \u0965","With their awareness dedicated to Me, their life runs with Me as the basis. They share awareness about Me among one another. Then they describe Me at all times. They enjoy it and take pleasure in listening."],t.w)
B.LC=new A.d(B.c,["\u0924\u0947\u0937\u093e\u092e\u094d \u0938\u0924\u0924 \u092f\u0941\u0915\u094d\u0924\u093e\u0928\u093e\u092e\u094d \u092d\u091c\u0924\u093e\u092e\u094d \u092a\u094d\u0930\u0940\u0924\u093f \u092a\u0942\u0930\u094d\u0935\u0915\u092e\u094d \u0964\n\u0926\u0926\u093e\u092e\u093f \u092c\u0941\u0926\u094d\u0927\u093f\u092f\u094b\u0917\u092e\u094d \u0924\u092e\u094d \u092f\u0947\u0928 \u092e\u093e\u092e\u094d \u0909\u092a\u092f\u093e\u0928\u094d\u0924\u093f \u0924\u0947 \u0965 \u0967\u0966 \u0965","To those who worship Me to be with Me always, I shall give, with great affection, that intellectual grasp by which they attain Me."],t.w)
B.Le=new A.d(B.c,["\u0924\u0947\u0937\u093e\u092e\u094d \u090f\u0935 \u0905\u0928\u0941\u0915\u092e\u094d\u092a\u093e\u0930\u094d\u0925\u092e\u094d \u0905\u0939\u092e\u094d \u0905\u091c\u094d\u091e\u093e\u0928\u091c\u092e\u094d \u0924\u092e\u0903 \u0964\n\u0928\u093e\u0936\u092f\u093e\u092e\u093f \u0906\u0924\u094d\u092e\u092d\u093e\u0935\u0938\u094d\u0925\u094b \u091c\u094d\u091e\u093e\u0928 \u0926\u0940\u092a\u0947\u0928 \u092d\u093e\u0938\u094d\u0935\u0924\u093e \u0965 \u0967\u0967 \u0965","Due to compassion towards those very people, I stand as the subject of their thoughts, destroying the darkness of ignorance with the bright light of knowledge."],t.w)
B.KF=new A.d(B.c,["\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a -\n\u092a\u0930\u092e\u094d \u092c\u094d\u0930\u0939\u094d\u092e \u092a\u0930\u092e\u094d \u0927\u093e\u092e \u092a\u0935\u093f\u0924\u094d\u0930\u092e\u094d \u092a\u0930\u092e\u092e\u094d \u092d\u0935\u093e\u0928\u094d \u0964\n\u092a\u0941\u0930\u0941\u0937\u092e\u094d \u0936\u093e\u0936\u094d\u0935\u0924\u092e\u094d \u0926\u093f\u0935\u094d\u092f\u092e\u094d \u0906\u0926\u093f\u0926\u0947\u0935\u092e\u094d \u0905\u091c\u092e\u094d \u0935\u093f\u092d\u0941\u092e\u094d \u0965 \u0967\u0968 \u0965\n\u0906\u0939\u0941\u0903 \u0924\u094d\u0935\u093e\u092e\u094d \u090b\u0937\u092f\u0903 \u0938\u0930\u094d\u0935\u0947 \u0926\u0947\u0935\u0930\u094d\u0937\u093f\u0903 \u0928\u093e\u0930\u0926\u0938\u094d\u0924\u0925\u093e \u0964\n\u0905\u0938\u093f\u0924\u094b \u0926\u0947\u0935\u0932\u094b \u0935\u094d\u092f\u093e\u0938\u0903 \u0938\u094d\u0935\u092f\u092e\u094d \u091a\u0948\u0935 \u092c\u094d\u0930\u0935\u0940\u0937\u093f \u092e\u0947 \u0965 \u0967\u0969 \u0965","Arjuna said- All great thinkers who are devoted to You along with the divine sage Narada, the dark, unbound pious Vedavyasa say that You are the supreme might, the ultimate abode, You are the supreme purity, the greatest personality, ever-lasting, unaffected by the material world, the root of all powers, the One who is not created and the One with irresistible will. You tell this to me directly as well."],t.w)
B.Qh=new A.d(B.c,["\u0938\u0930\u094d\u0935\u092e\u094d \u090f\u0924\u0924\u094d \u090b\u0924\u092e\u094d \u092e\u0928\u094d\u092f\u0947 \u092f\u0924\u094d \u092e\u093e\u092e\u094d \u0935\u0926\u0938\u093f \u0915\u0947\u0936\u0935 \u0964\n\u0928 \u0939\u093f \u0924\u0947 \u092d\u0917\u0935\u0928\u094d \u0935\u094d\u092f\u0915\u094d\u0924\u093f\u092e\u094d \u0935\u093f\u0926\u0941\u0903 \u0926\u0947\u0935\u093e \u0928 \u0926\u093e\u0928\u0935\u093e\u0903 \u0965 \u0967\u096a \u0965","Krishna, I consider all this as the truth- everything You tell me. O Lord, indeed, nobody knows your personality - neither virtuous people nor the vile."],t.w)
B.LS=new A.d(B.c,["\u0938\u094d\u0935\u092f\u092e\u0947\u0935 \u0906\u0924\u094d\u092e\u0928\u093e \u0906\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u0935\u0947\u0924\u094d\u0925 \u0924\u094d\u0935\u092e\u094d \u092a\u0941\u0930\u0941\u0937\u094b\u0924\u094d\u0924\u092e \u0964\n\u092d\u0942\u0924 \u092d\u093e\u0935\u0928 \u092d\u0942\u0924\u0947\u0936 \u0926\u0947\u0935\u0926\u0947\u0935 \u091c\u0917\u0924\u094d\u092a\u0924\u0947 \u0965 \u0967\u096b \u0965","O best among men, You alone know Yourself with Your own mind. You are the origin of all beings, the controller of all beings, the supreme power , the Lord of the universe."],t.w)
B.OF=new A.d(B.c,["\u0935\u0915\u094d\u0924\u0941\u092e\u094d \u0905\u0930\u094d\u0939\u0938\u093f \u0905\u0936\u0947\u0937\u0947\u0923 \u0926\u093f\u0935\u094d\u092f\u093e \u0939\u094d\u092f\u093e\u0924\u094d\u092e \u0935\u093f\u092d\u0942\u0924\u092f\u0903 \u0964\n\u092f\u093e\u092d\u093f\u0903 \u0935\u093f\u092d\u0942\u0924\u093f\u092d\u093f\u0903 \u0932\u094b\u0915\u093e\u0928\u094d \u0907\u092e\u093e\u092e\u094d \u0924\u094d\u0935\u092e\u094d \u0935\u094d\u092f\u093e\u092a\u094d\u092f \u0924\u093f\u0937\u094d\u0920\u0938\u093f \u0965 \u0967\u096c \u0965","You must now describe to me Your expanse of power entirely. Your powers are indeed divine. With these supreme powers, You stay pervading these worlds."],t.w)
B.Nf=new A.d(B.c,["\u0915\u0925\u092e\u094d \u0935\u093f\u0926\u094d\u092f\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u092f\u094b\u0917\u0940 \u0924\u094d\u0935\u093e\u092e\u094d \u0938\u0926\u093e \u092a\u0930\u093f\u091a\u093f\u0928\u094d\u0924\u092f\u0928\u094d \u0964\n\u0915\u0947\u0937\u0941 \u0915\u0947\u0937\u0941 \u091a \u092d\u093e\u0935\u0947\u0937\u0941 \u091a\u093f\u0928\u094d\u0924\u094d\u092f\u094b \u0905\u0938\u093f \u092d\u0917\u0935\u0928\u094d \u092e\u092f\u093e \u0965 \u0967\u096d \u0965","I am in the quest of Your devotion . How do I know You, while thinking about You always? O Lord, in what forms and thoughts are You to be thought about by Me?"],t.w)
B.PP=new A.d(B.c,["\u0935\u093f\u0938\u094d\u0924\u0930\u0947\u0923 \u0906\u0924\u094d\u092e\u0928\u094b \u092f\u094b\u0917\u092e\u094d \u0935\u093f\u092d\u0942\u0924\u093f\u092e\u094d \u091a \u091c\u0928\u093e\u0930\u094d\u0926\u0928 \u0964\n\u092d\u0942\u092f\u0903 \u0915\u0925\u092f \u0924\u0943\u092a\u094d\u0924\u093f\u0930\u094d\u0939\u093f \u0936\u0943\u0923\u094d\u0935\u0924\u094b \u0928\u093e\u0938\u094d\u0924\u093f \u092e\u0947 \u0905\u092e\u0943\u0924\u092e\u094d \u0965 \u0967\u096e \u0965","Krishna, Tell me again about Your greatness and Your supreme might. While I listen and drink its sweetness, I crave for more."],t.w)
B.PH=new A.d(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u0939\u0928\u094d\u0924 \u0924\u0947 \u0915\u0925\u092f\u093f\u0937\u094d\u092f\u093e\u092e\u093f \u0935\u093f\u092d\u0942\u0924\u0940\u0903 \u0906\u0924\u094d\u092e\u0928\u0903 \u0936\u0941\u092d\u093e\u0903 \u0964\n\u092a\u094d\u0930\u093e\u0927\u093e\u0928\u094d\u092f\u0924\u0903 \u0915\u0941\u0930\u0941\u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u0928\u093e\u0938\u094d\u0924\u094d\u092f\u0928\u094d\u0924\u094b \u0935\u093f\u0938\u094d\u0924\u0930\u0938\u094d\u092f \u092e\u0947 \u0965 \u0967\u096f \u0965","Lord Krishna said Good! Arjuna, I will tell you what stands out in the favorable expanse of My might and My irresistible will. There is no end to My expanse."],t.w)
B.IN=new A.d(B.c,["\u0905\u0939\u092e\u094d \u0906\u0924\u094d\u092e\u093e \u0917\u0941\u0921\u093e\u0915\u0947\u0936 \u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u093e\u0936\u092f \u0938\u094d\u0925\u093f\u0924\u0903 \u0964\n\u0905\u0939\u092e\u094d \u0906\u0926\u093f\u0936\u094d\u091a \u092e\u0927\u094d\u092f\u092e\u094d \u091a \u092d\u0942\u0924\u093e\u0928\u093e\u092e\u094d \u0905\u0928\u094d\u0924 \u090f\u0935 \u091a \u0965 \u0968\u0966 \u0965","Arjuna, I am situated in all beings at their core as the Self. Moreover, I am the beginning, as well as the end and everything in-between."],t.w)
B.Pg=new A.d(B.c,["\u0906\u0926\u093f\u0924\u094d\u092f\u093e\u0928\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0935\u093f\u0937\u094d\u0923\u0941\u0903 \u091c\u094d\u092f\u094b\u0924\u093f\u0937\u093e\u092e\u094d \u0930\u0935\u093f\u0903 \u0905\u0928\u094d\u0936\u0941\u092e\u093e\u0928\u094d \u0964\n\u092e\u0930\u0940\u091a\u093f\u0903 \u092e\u0930\u0941\u0924\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u0928\u0915\u094d\u0937\u0924\u094d\u0930\u093e\u0923\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0936\u0936\u0940 \u0965 \u0968\u0967 \u0965","In the powers of nature , I am Vishnu, the all-pervasive. In all luminous things, I am the sun that has the greatest brightness. Among the powers of war, I am the most powerful. Among the stars, I appear as the moon."],t.w)
B.OH=new A.d(B.c,["\u0935\u0947\u0926\u093e\u0928\u093e\u092e\u094d \u0938\u093e\u092e\u0935\u0947\u0926\u094b\u093d\u0938\u094d\u092e\u093f \u0926\u0947\u0935\u093e\u0928\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u0935\u093e\u0938\u0935\u0903 \u0964\n\u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u093e\u0923\u093e\u092e\u094d \u092e\u0928\u0936\u094d\u091a \u0905\u0938\u094d\u092e\u093f \u092d\u0942\u0924\u093e\u0928\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u091a\u0947\u0924\u0928\u093e \u0965 \u0968\u0968 \u0965","Among the Vedas, I am the Sama Veda. Among the gods , I am their Lord. Among our sense organs, I am the mind and I am consciousness in all beings."],t.w)
B.Jo=new A.d(B.c,["\u0930\u0941\u0926\u094d\u0930\u093e\u0923\u093e\u092e\u094d \u0936\u0919\u094d\u0915\u0930\u0903 \u091a\u093e\u0938\u094d\u092e\u093f \u0935\u093f\u0924\u094d\u0924\u0947\u0936\u094b \u092f\u0915\u094d\u0937 \u0930\u0915\u094d\u0937\u0938\u093e\u092e\u094d \u0964\n\u0935\u0938\u0942\u0928\u093e\u092e\u094d \u092a\u093e\u0935\u0915\u0903 \u091a\u093e\u0938\u094d\u092e\u093f \u0936\u093f\u0916\u0930\u093f\u0923\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u092e\u0947\u0930\u0941\u0903 \u0965 \u0968\u0969 \u0965","Among manifestations of Rudra who destroys the unfavorable, I am Shankara, the one who brings prosperity. To the virtuous and vile who crave wealth and power, I am the hugely wealthy one. Among the entities of the universe, I am energy. Among the peaks, I am the huge mountain that shines the brightest."],t.w)
B.QC=new A.d(B.c,["\u092a\u0941\u0930\u094b\u0927\u0938\u093e\u092e\u094d \u091a \u092e\u0941\u0916\u094d\u092f\u092e\u094d \u092e\u093e\u092e\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u092a\u093e\u0930\u094d\u0925 \u092c\u0943\u0939\u0938\u094d\u092a\u0924\u093f\u092e\u094d \u0964\n\u0938\u0947\u0928\u093e\u0928\u0940\u0928\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0938\u094d\u0915\u0928\u094d\u0926\u0903 \u0938\u0930\u0938\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u0938\u093e\u0917\u0930\u0903 \u0965 \u0968\u096a \u0965","Arjuna, among the chief priests and highly valued advisors, know Me to be Brihaspati, the master of all great people. Among the commanders of armies, I am Skanda, the leader who is supreme in attack. To all water bodies, I am the inexhaustible ocean."],t.w)
B.Pc=new A.d(B.c,["\u092e\u0939\u0930\u094d\u0937\u0940\u0923\u093e\u092e\u094d \u092d\u0943\u0917\u0941\u0930\u0939\u092e\u094d \u0917\u093f\u0930\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u090f\u0915\u092e\u094d \u0905\u0915\u094d\u0937\u0930\u092e\u094d \u0964\n\u092f\u091c\u094d\u091e\u093e\u0928\u093e\u092e\u094d \u091c\u092a \u092f\u091c\u094d\u091e\u094b\u093d\u0938\u094d\u092e\u093f \u0938\u094d\u0925\u093e\u0935\u0930\u093e\u0923\u093e\u092e\u094d \u0939\u093f\u092e\u093e\u0932\u092f\u0903 \u0965 \u0968\u096b \u0965","Among the great sages, I am Bhrgu. Among all speech, I am the first sound. Among the various forms of worship, I am the worship that takes the form of a prayer. Among the immovable mountains, I am the Himalaya."],t.w)
B.O6=new A.d(B.c,["\u0905\u0936\u094d\u0935\u0924\u094d\u0925\u0903 \u0938\u0930\u094d\u0935 \u0935\u0943\u0915\u094d\u0937\u093e\u0923\u093e\u092e\u094d \u0926\u0947\u0935\u0930\u094d\u0937\u0940\u0923\u093e\u092e\u094d \u091a \u0928\u093e\u0930\u0926\u0903 \u0964\n\u0917\u0928\u094d\u0927\u0930\u094d\u0935\u093e\u0923\u093e\u092e\u094d \u091a\u093f\u0924\u094d\u0930\u0930\u0925\u0903 \u0938\u093f\u0926\u094d\u0927\u093e\u0928\u093e\u092e\u094d \u0915\u092a\u093f\u0932\u094b \u092e\u0941\u0928\u093f\u0903 \u0965 \u0968\u096c \u0965\n\u0909\u091a\u094d\u091a\u0948\u0936\u094d\u0930\u0935\u0938\u092e\u094d \u0905\u0936\u094d\u0935\u093e\u0928\u093e\u092e\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u092e\u093e\u092e\u094d \u0905\u092e\u0943\u0924\u094b\u0926\u094d\u092d\u0935\u092e\u094d \u0964\n\u0910\u0930\u093e\u0935\u0924\u092e\u094d \u0917\u091c\u0947\u0928\u094d\u0926\u094d\u0930\u093e\u0923\u093e\u092e\u094d \u0928\u0930\u093e\u0923\u093e\u092e\u094d \u091a \u0928\u0930\u093e\u0927\u093f\u092a\u092e\u094d \u0965 \u0968\u096d \u0965\n\u0906\u092f\u0941\u0927\u093e\u0928\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0935\u091c\u094d\u0930\u092e\u094d \u0927\u0947\u0928\u0942\u0928\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u0915\u093e\u092e\u0927\u0941\u0915\u094d \u0964\n\u092a\u094d\u0930\u091c\u0928\u0936\u094d\u091a\u093e\u0938\u094d\u092e\u093f \u0915\u0928\u094d\u0926\u0930\u094d\u092a\u0903 \u0938\u0930\u094d\u092a\u093e\u0923\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u0935\u093e\u0938\u0941\u0915\u093f\u0903 \u0965 \u0968\u096e \u0965\n\u0906\u0928\u0928\u094d\u0924\u0936\u094d\u091a\u093e\u0938\u094d\u092e\u093f \u0928\u093e\u0917\u093e\u0928\u093e\u092e\u094d \u0935\u0930\u0941\u0923\u094b \u092f\u093e\u0926\u0938\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0964\n\u092a\u093f\u0924\u0943\u093d\u0923\u093e\u092e\u094d \u0905\u0930\u094d\u092f\u092e\u093e \u091a\u093e\u0938\u094d\u092e\u093f \u092f\u092e\u0903 \u0938\u092e\u094d\u092f\u092e\u0924\u093e\u092e\u0939\u092e\u094d \u0965 \u0968\u096f \u0965","Among all trees, I am the Pepal. Among the sages who compose divine verse, I am Narada, who founded such compositions. To the Gandharvas, I am their chief. Among accomplished people, I am Kapila, the ascetic who founded the philosophy of logic. Know Me to arise from nectar. Know Me as the origin and king of horses among horses; as Airavata, the best elephant among the best of elephants and as the leader of humans among human beings. In weapons, I am the hard sharpness. In cows, I am the one who satisfies wishes. I am the love which begets progeny. Among the snakes of this world, I am Vasuki, who is the most worshipped snake, whom the gods and demons employed to churn the ocean. To all snakes, I am Adishesha. Among the beings who live in water, I am Varuna. To the ancestors, I am a companion and friend. To the people who maintain control, I am self-restraint."],t.w)
B.K1=new A.d(B.c,["\u092a\u094d\u0930\u0939\u094d\u0932\u093e\u0926\u0903 \u091a\u093e\u0938\u094d\u092e\u093f \u0926\u0948\u0924\u094d\u092f\u093e\u0928\u093e\u092e\u094d \u0915\u093e\u0932\u0903 \u0915\u0932\u092f\u0924\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0964\n\u092e\u0943\u0917\u093e\u0923\u093e\u092e\u094d \u091a \u092e\u0943\u0917\u0947\u0928\u094d\u0926\u094d\u0930\u094b\u093d\u0939\u092e\u094d \u0935\u0948\u0928\u0924\u0947\u092f\u0903 \u091a \u092a\u0915\u094d\u0937\u093f\u0923\u093e\u092e\u094d \u0965 \u0969\u0966 \u0965","Among the demons, I am Prahlada, the friendly boy. To the calculative people who bring about destruction, I am death. Among animals, I am their leader. Among birds, I am Garuda, their chief."],t.w)
B.Lz=new A.d(B.c,["\u092a\u0935\u0928\u0903 \u092a\u0935\u0924\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u0930\u093e\u092e\u0903 \u0936\u0938\u094d\u0924\u094d\u0930 \u092d\u0943\u0924\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0964\n\u091d\u0937\u093e\u0923\u093e\u092e\u094d \u092e\u0915\u0930\u0903 \u091a\u093e\u0938\u094d\u092e\u093f \u0938\u094d\u0930\u094b\u0924\u0938\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u091c\u093e\u0939\u094d\u0928\u0935\u0940 \u0965 \u0969\u0967 \u0965","To things that have movement in their nature, I am the wind. Among people who bear arms, I am Lord Rama, the ultimate gentleman warrior. Among marine predators, I am the crocodile. Among rivers, I am the river Ganga."],t.w)
B.P5=new A.d(B.c,["\u0938\u0930\u094d\u0917\u093e\u0923\u093e\u092e\u094d \u0906\u0926\u093f\u0930\u0928\u094d\u0924\u0903 \u091a \u092e\u0927\u094d\u092f\u092e\u094d \u091a\u0948\u0935\u093e\u0939\u092e\u094d \u0905\u0930\u094d\u091c\u0941\u0928 \u0964\n\u0905\u0927\u094d\u092f\u093e\u0924\u094d\u092e \u0935\u093f\u0926\u094d\u092f\u093e \u0935\u093f\u0926\u094d\u092f\u093e\u0928\u093e\u092e\u094d \u0935\u093e\u0926\u0903 \u092a\u094d\u0930\u0935\u0926\u0924\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0965 \u0969\u0968 \u0965","Arjuna, all creations have Me as the beginning, the end and everything in-between. In all knowledge, I am the fundamental knowledge about the Self, its relation to the Universe and the Lord. Among people who debate, I am the point that closes the argument."],t.w)
B.P7=new A.d(B.c,["\u0905\u0915\u094d\u0937\u0930\u093e\u0923\u093e\u092e\u094d \u0905\u0915\u093e\u0930\u094b\u093d\u0938\u094d\u092e\u093f \u0926\u094d\u0935\u0928\u094d\u0926\u094d\u0935\u0903 \u0938\u093e\u092e\u093e\u0938\u093f\u0915\u0938\u094d\u092f \u091a \u0964\n\u0905\u0939\u092e\u094d \u090f\u0935 \u0905\u0915\u094d\u0937\u092f\u0903 \u0915\u093e\u0932\u094b \u0927\u093e\u0924\u093e\u0939\u092e\u094d \u0935\u093f\u0936\u094d\u0935\u0924\u094b \u092e\u0941\u0916\u0903 \u0965 \u0969\u0969 \u0965","In alphabets, I am the primary element, the phonetic 'a'. Among the various methods of combining words, I am the dvandva. I alone am the time that never wanes. I am the One who brought about all creation, having four heads, looking over all of My creation."],t.w)
B.O3=new A.d(B.c,["\u092e\u0943\u0924\u094d\u092f\u0941\u0903 \u0938\u0930\u094d\u0935\u0939\u0930\u0903 \u091a\u093e\u0939\u092e\u094d \u0909\u0926\u094d\u092d\u0935\u0903 \u091a \u092d\u0935\u093f\u0937\u094d\u092f\u0924\u093e\u092e\u094d \u0964\n\u0915\u0940\u0930\u094d\u0924\u093f\u0903 \u0936\u094d\u0930\u0940\u0903 \u0935\u093e\u0915\u0936\u094d\u091a \u0928\u093e\u0930\u0940\u0923\u093e\u092e\u094d \u0938\u094d\u092e\u0943\u0924\u093f\u0930\u094d\u092e\u0947\u0927\u093e \u0927\u0943\u0924\u093f\u0903 \u0915\u094d\u0937\u092e\u093e \u0965 \u0969\u096a \u0965","I am the termination that takes away everything. I am the act of creation to things which will be created. Among ladies, I am Lakshmi and that which is called as luster. I am speech. I am memory-recall, I am talent, courage and resolve. I am forgiveness ."],t.w)
B.OG=new A.d(B.c,["\u092c\u0943\u0939\u0924\u094d\u0938\u093e\u092e \u0924\u0925\u093e \u0938\u093e\u092e\u094d\u0928\u093e\u092e\u094d \u0917\u093e\u092f\u0924\u094d\u0930\u0940 \u091b\u0928\u094d\u0926\u0938\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0964\n\u092e\u093e\u0938\u093e\u0928\u093e\u092e\u094d \u092e\u093e\u0930\u094d\u0917\u0936\u0940\u0930\u094d\u0937\u094b\u093d\u0939\u092e\u094d \u090b\u0924\u0942\u0928\u093e\u092e\u094d \u0915\u0941\u0938\u0941\u092e\u093e\u0915\u0930\u0903 \u0965 \u0969\u096b \u0965","Among calming and gentle tunes, I am the one that spans all of thought and speech. Among the poetical metres, I am the Gayatri. Among the months, I am Margashirsha, when the rain-bearing clouds give way to pleasant and prosperous times. Among the seasons, I am the spring-time, the season when flowers bloom and all beings are comforted."],t.w)
B.NP=new A.d(B.c,["\u0926\u094d\u092f\u0942\u0924\u092e\u094d \u091b\u0932\u092f\u0924\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u0924\u0947\u091c\u0903 \u0924\u0947\u091c\u0938\u094d\u0935\u093f\u0928\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0964\n\u091c\u092f\u094b\u0938\u094d\u092e\u093f \u0935\u094d\u092f\u0935\u0938\u093e\u092f\u094b\u093d\u0938\u094d\u092e\u093f \u0938\u0924\u094d\u0924\u094d\u0935\u092e\u094d \u0938\u0924\u094d\u0924\u094d\u0935\u0935\u0924\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0965 \u0969\u096c \u0965","Among people who intend to deceive, I am gambling. To the brilliant, I am brilliance. I am victory. I am determination and perseverance. To people who are endowed with wisdom and virtue, I am the wisdom and the virtue."],t.w)
B.Li=new A.d(B.c,["\u0935\u0943\u0937\u094d\u0923\u0940\u0928\u093e\u092e\u094d \u0935\u093e\u0938\u0941\u0926\u0947\u0935\u094b\u093d\u0938\u094d\u092e\u093f \u092a\u093e\u0928\u094d\u0921\u0935\u093e\u0928\u093e\u092e\u094d \u0927\u0928\u0928\u094d\u091c\u092f\u0903 \u0964\n\u092e\u0941\u0928\u0940\u0928\u093e\u092e\u094d \u0905\u092a\u094d\u092f\u0939\u092e\u094d \u0935\u094d\u092f\u093e\u0938\u0903 \u0915\u0935\u0940\u0928\u093e\u092e\u094d \u0909\u0936\u0928\u093e \u0915\u0935\u093f\u0903 \u0965 \u0969\u096d \u0965","Among the mighty and passionate, I am Krishna, the son of Vasudeva. Among the Pandava, I am Arjuna, who carries the bow. Among those who have realized the Self through knowledge and meditation, I am Vedavyasa. Among teachers of strategy, I am Shukracharya."],t.w)
B.Qr=new A.d(B.c,["\u0926\u0902\u0921\u094b \u0926\u092e\u092f\u0924\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u0928\u0940\u0924\u093f\u0930\u0938\u094d\u092e\u093f \u091c\u093f\u0917\u0940\u0937\u0924\u093e\u092e\u094d \u0964\n\u092e\u094c\u0928\u092e\u094d \u091a\u0948\u0935\u093e\u0938\u094d\u092e\u093f \u0917\u0941\u0939\u094d\u092f\u093e\u0928\u093e\u092e\u094d \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u091c\u094d\u091e\u093e\u0928\u0935\u0924\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0965 \u0969\u096e \u0965","To the people who punish, I am punishment. To those who desire to conquer, I am policy and prudence. Among things that are inscrutable, I am silence. I am knowledge to those who know."],t.w)
B.IY=new A.d(B.c,["\u092f\u0924\u094d \u091a\u093e\u092a\u093f \u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u093e\u0928\u093e\u092e\u094d \u092c\u0940\u091c\u092e\u094d \u0924\u0926\u0939\u092e\u094d \u0905\u0930\u094d\u091c\u0941\u0928 \u0964\n\u0928 \u0924\u0926\u0938\u094d\u0924\u093f \u0935\u093f\u0928\u093e \u092f\u0924\u094d \u0938\u094d\u092f\u093e\u0924\u094d \u092e\u092f\u093e \u092d\u0942\u0924\u092e\u094d \u091a\u0930\u093e\u091a\u0930\u092e\u094d \u0965 \u0969\u096f \u0965","Arjuna, whatever is the source of all beings, I am that. It is impossible for any being, moving or stationary, to exist without Me."],t.w)
B.LU=new A.d(B.c,["\u0928 \u0905\u0928\u094d\u0924\u094b\u093d\u0938\u094d\u0924\u093f \u092e\u092e \u0926\u093f\u0935\u094d\u092f\u093e\u0928\u093e\u092e\u094d \u0935\u093f\u092d\u0942\u0924\u0940\u0928\u093e\u092e\u094d \u092a\u0930\u0928\u094d\u0924\u092a \u0964\n\u090f\u0937 \u0924\u0941 \u0909\u0926\u094d\u0926\u0947\u0936\u0924\u0903 \u092a\u094d\u0930\u094b\u0915\u094d\u0924\u094b \u0935\u093f\u092d\u0942\u0924\u0947\u0903 \u0935\u093f\u0938\u094d\u0924\u0930\u094b \u092e\u092f\u093e \u0965 \u096a\u0966 \u0965","Arjuna, there is no end to my wondrous pervasive expanse. The expanse of this great power was told by Me as a summary."],t.w)
B.IZ=new A.d(B.c,["\u092f\u0926\u094d\u092f\u0926\u094d \u0935\u093f\u092d\u0942\u0924\u093f\u092e\u0924\u094d \u0938\u0924\u094d\u0924\u094d\u0935\u092e\u094d \u0936\u094d\u0930\u0940\u092e\u0924\u094d \u090a\u0930\u094d\u091c\u093f\u0924\u092e\u094d \u090f\u0935 \u0935\u093e \u0964\n\u0924\u0924\u094d\u0924\u0926\u094d \u090f\u0935\u093e\u0917\u091a\u094d\u091b \u0924\u094d\u0935\u092e\u094d \u092e\u092e \u0924\u0947\u091c\u094b\u093d\u092e\u094d\u0936 \u0938\u092e\u094d\u092d\u0935\u092e\u094d \u0965 \u096a\u0967 \u0965","What ever is endowed with brilliance or endowed with excellence - realize that every such entity is under My control. It has taken birth from a piece of My brilliance."],t.w)
B.L5=new A.d(B.c,["\u0905\u0925\u0935\u093e \u092c\u0939\u0941\u0928\u0948\u0924\u0947\u0928 \u0915\u093f\u092e\u094d \u091c\u094d\u091e\u093e\u0924\u0947\u0928 \u0924\u0935\u093e\u0930\u094d\u091c\u0941\u0928 \u0964\n\u0935\u093f\u0937\u094d\u091f\u092d\u094d\u092f\u093e\u0939\u092e\u094d \u0907\u0926\u092e\u094d \u0915\u0943\u0924\u094d\u0938\u094d\u0928\u092e\u094d \u090f\u0915\u093e\u092e\u094d\u0936\u0947\u0928 \u0938\u094d\u0925\u093f\u0924\u094b \u091c\u0917\u0924\u094d \u0965 \u096a\u0968 \u0965","Arjuna, what's further elaboration of this knowledge to you? I support and control this entire universe, which is situated in one part of My being."],t.w)
B.IV=new A.d(B.c,["\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a -\n\u092e\u0926\u0928\u0941\u0917\u094d\u0930\u0939\u093e\u092f \u092a\u0930\u092e\u092e\u094d \u0917\u0941\u0939\u094d\u092f\u092e\u094d \u0905\u0927\u094d\u092f\u093e\u0924\u094d\u092e \u0938\u0928\u094d\u091c\u094d\u091e\u093f\u0924\u092e\u094d \u0964\n\u092f\u0924\u094d \u0924\u094d\u0935\u092f\u094b\u0915\u094d\u0924\u092e\u094d \u0935\u091a\u0938\u094d\u0924\u0947\u0928 \u092e\u094b\u0939\u094b\u093d\u092f\u092e\u094d \u0935\u093f\u0917\u0924\u094b \u092e\u092e \u0965 \u0967 \u0965","Arjuna said - The teaching, which You have imparted for my benefit, out of Love, which is supremely concealed, is the knowledge of the Self. By that teaching, this confusion of mine is gone."],t.w)
B.Ka=new A.d(B.c,["\u092d\u0935\u093e\u092a\u094d\u092f\u092f\u094c \u0939\u093f \u092d\u0942\u0924\u093e\u0928\u093e\u092e\u094d \u0936\u094d\u0930\u0941\u0924\u094c \u0935\u093f\u0938\u094d\u0924\u0930\u0936\u094b \u092e\u092f\u093e \u0964\n\u0924\u094d\u0935\u0924\u094d\u0924\u0903 \u0915\u092e\u0932 \u092a\u0924\u094d\u0930\u093e\u0915\u094d\u0937 \u092e\u093e\u0939\u093e\u0924\u094d\u092e\u094d\u092f\u092e\u094d \u0905\u092a\u093f \u091a\u093e\u0935\u094d\u092f\u092f\u092e\u094d \u0965 \u0968 \u0965","Krishna, You have eyes as beautiful as lotus leaves. I listened to the elaboration of the creation and destruction of all beings, which is brought about by You. I also listened to Your unending greatness."],t.w)
B.IP=new A.d(B.c,["\u090f\u0935\u092e\u094d \u090f\u0924\u0924\u094d \u092f\u0925\u093e \u0906\u0924\u094d\u0925 \u0924\u094d\u0935\u092e\u094d \u0906\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u092a\u0930\u092e\u0947\u0936\u094d\u0935\u0930 \u0964\n\u0926\u094d\u0930\u0937\u094d\u091f\u0941\u092e\u094d \u0907\u091a\u094d\u091b\u093e\u092e\u093f \u0924\u0947 \u0930\u0942\u092a\u092e\u094d \u0910\u0936\u094d\u0935\u0930\u092e\u094d \u092a\u0941\u0930\u0941\u0937\u094b\u0924\u094d\u0924\u092e \u0965 \u0969 \u0965","O Lord of everything, The way in which You described Yourself is a statement of fact. O Best Among Men, I would like to see Your form with Your supreme might , Your ability to pervade and control everything."],t.w)
B.J8=new A.d(B.c,["\u092e\u0928\u094d\u092f\u0938\u0947 \u092f\u0926\u093f \u092e\u091a\u094d\u091b\u0915\u094d\u092f\u092e\u094d \u092e\u092f\u093e \u0926\u094d\u0930\u0937\u094d\u091f\u0941\u092e\u094d \u0907\u0924\u093f \u092a\u094d\u0930\u092d\u094b \u0964\n\u092f\u094b\u0917\u0947\u0936\u094d\u0935\u0930 \u0924\u0924\u094b \u092e\u0947 \u0924\u094d\u0935\u092e\u094d \u0926\u0930\u094d\u0936\u092f\u093e\u093d\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u0905\u0935\u094d\u092f\u092f\u092e\u094d \u0965 \u096a \u0965","Lord, if You believe that it's possible for me to see it, then show me Your undiminished self entirely. You are the Lord of all favorable associations."],t.w)
B.O5=new A.d(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u092a\u0936\u094d\u092f \u092e\u0947 \u092a\u093e\u0930\u094d\u0925 \u0930\u0942\u092a\u093e\u0923\u093f \u0936\u0924\u0936\u094b\u093d\u0925 \u0938\u0939\u0938\u094d\u0930\u0936\u0903 \u0964\n\u0928\u093e\u0928\u093e \u0935\u093f\u0927\u093e\u0928\u093f \u0926\u093f\u0935\u094d\u092f\u093e\u0928\u093f \u0928\u093e\u0928\u093e \u0935\u0930\u094d\u0923\u093e\u0915\u0943\u0924\u0940\u0928\u093f \u091a \u0965 \u096b \u0965","Lord Krishna said - Arjuna, see My forms in their hundreds and thousands, they are extraordinary, they are of many types, having multitudes of colors and appearances"],t.w)
