B.OB=new A.d(B.c,["\u0936\u0930\u0940\u0930\u092e\u094d \u092f\u0926\u0935\u093e\u092a\u094d\u0928\u094b\u0924\u093f \u092f\u091a\u094d\u091a\u093e\u092a\u093f \u0909\u0924\u094d\u0915\u094d\u0930\u093e\u092e\u0924\u0940\u0936\u094d\u0935\u0930\u0903 \u0964\n\u0917\u0943\u0939\u0940\u0924\u094d\u0935 \u090f\u0924\u093e\u0928\u093f \u0938\u092e\u094d\u092f\u093e\u0924\u093f \u0935\u093e\u092f\u0941\u0930\u094d\u0917\u0928\u094d\u0927\u093e\u0928\u094d \u0907\u0935\u093e\u0936\u092f\u093e\u0924\u094d \u0965 \u096e \u0965","The owner carries the essence of the body it gets to own, and the one that it leaves. It departs like the wind that takes the fragrance from its source."],t.w)
B.PN=new A.d(B.c,["\u0936\u094d\u0930\u094b\u0924\u094d\u0930\u092e\u094d \u091a\u0915\u094d\u0937\u0941\u0903 \u0938\u094d\u092a\u0930\u094d\u0936\u0928\u092e\u094d \u091a \u0930\u0938\u0928\u092e\u094d \u0918\u094d\u0930\u093e\u0923\u092e\u094d \u090f\u0935 \u091a \u0964\n\u0905\u0927\u093f\u0937\u094d\u0920\u093e\u092f \u092e\u0928\u0903 \u091a\u093e\u092f\u092e\u094d \u0935\u093f\u0937\u092f\u093e\u0928\u094d \u0909\u092a\u0938\u0947\u0935\u0924\u0947 \u0965 \u096f \u0965","This Self employs the ears, eyes, skin, tongue, nose and the mind to experience the stimuli in the material world."],t.w)
B.KE=new A.d(B.c,["\u0909\u0924\u094d\u0915\u094d\u0930\u093e\u092e\u0928\u094d\u0924\u092e\u094d \u0938\u094d\u0925\u093f\u0924\u092e\u094d \u0935\u093e\u093d\u092a\u093f \u092d\u0941\u0928\u094d\u091c\u093e\u0928\u092e\u094d \u0935\u093e \u0917\u0941\u0923\u093e\u0928\u094d\u0935\u093f\u0924\u092e\u094d \u0964\n\u0935\u093f\u092e\u0942\u0922\u093e \u0928\u093e\u0928\u0941\u092a\u0936\u094d\u092f\u0928\u094d\u0924\u093f \u092a\u0936\u094d\u092f\u0928\u094d\u0924\u093f \u091c\u094d\u091e\u093e\u0928 \u091a\u0915\u094d\u0937\u0941\u0937\u093e\u0903 \u0965 \u0967\u0966 \u0965","The ignorant do not recognize the Self when it departs from the body, or when it is situated in their own body, or even when it's experiencing the material world, when it is bound in the three qualities . Those endowed with the eyes of knowledge do see it."],t.w)
B.LG=new A.d(B.c,["\u092f\u0924\u0928\u094d\u0924\u094b \u092f\u094b\u0917\u093f\u0928\u0903 \u091a\u0948\u0928\u092e\u094d \u092a\u0936\u094d\u092f\u0928\u094d\u0924\u093f \u0906\u0924\u094d\u092e\u0928\u093f \u0905\u0935\u0938\u094d\u0925\u093f\u0924\u092e\u094d \u0964\n\u092f\u0924\u0928\u094d\u0924\u094b\u093d\u092a\u093f \u0905\u0915\u0943\u0924\u093e\u0924\u094d\u092e\u093e\u0928\u094b \u0928\u0948\u0928\u092e\u094d \u092a\u0936\u094d\u092f\u0928\u094d\u0924\u093f \u0905\u091a\u0947\u0924\u0938\u0903 \u0965 \u0967\u0967 \u0965","Those who realize their relationship with the Lord and persevere in its practice shall see the Self present in themselves. On the other hand, those who haven\u2019t surrendered to the Lord do not see the Self even with perseverance - They remain without recognizing the Self."],t.w)
B.JJ=new A.d(B.c,["\u092f\u0924\u094d \u0906\u0926\u093f\u0924\u094d\u092f\u0917\u0924\u092e\u094d \u0924\u0947\u091c\u094b \u091c\u0917\u0924\u094d \u092d\u093e\u0938\u092f\u0924\u0947\u093d\u0916\u093f\u0932\u092e\u094d \u0964\n\u092f\u0924\u094d \u091a\u0928\u094d\u0926\u094d\u0930\u092e\u0938\u093f \u092f\u0924\u094d \u091a\u093e\u0917\u094d\u0928\u094c \u0924\u0924\u094d \u0924\u0947\u091c\u094b \u0935\u093f\u0926\u094d\u0927\u093f \u092e\u093e\u092e\u0915\u092e\u094d \u0965 \u0967\u0968 \u0965","Know that the brilliance that comes from the Sun, which illuminates the entire universe, the luster that comes from the moon, even the light that comes from fire - that light is mine."],t.w)
B.Mj=new A.d(B.c,["\u0917\u093e\u092e\u093e\u0935\u093f\u0936\u094d\u092f \u091a \u092d\u0942\u0924\u093e\u0928\u093f \u0927\u093e\u0930\u092f\u093e\u092e\u093f \u0905\u0939\u092e\u094d \u0913\u091c\u0938\u093e \u0964\n\u092a\u0941\u0937\u094d\u0923\u093e\u092e\u093f \u091a\u094c\u0937\u0927\u0940\u0903 \u0938\u0930\u094d\u0935\u093e\u0903 \u0938\u094b\u092e\u094b \u092d\u0942\u0924\u094d\u0935\u093e \u0930\u0938\u093e\u0924\u094d\u092e\u0915\u0903 \u0965 \u0967\u0969 \u0965","Pervading the earth, I sustain all the beings here by My strength. I nurture all plants. I am the essence of taste, I am the nectar."],t.w)
B.Jq=new A.d(B.c,["\u0905\u0939\u092e\u094d \u0935\u0948\u0936\u094d\u0935\u093e\u0928\u0930\u094b \u092d\u0942\u0924\u094d\u0935\u093e \u092a\u094d\u0930\u093e\u0923\u093f\u0928\u093e\u092e\u094d \u0926\u0947\u0939\u092e\u094d \u0906\u0936\u094d\u0930\u093f\u0924\u0903 \u0964\n\u092a\u094d\u0930\u093e\u0923\u093e\u092a\u093e\u0928 \u0938\u092e\u093e\u092f\u0941\u0915\u094d\u0924\u0903 \u092a\u091a\u093e\u092e\u094d\u092f\u0928\u094d\u0928\u092e\u094d \u091a\u0924\u0941\u0930\u094d\u0935\u093f\u0927\u092e\u094d \u0965 \u0967\u096a \u0965","I embed Myself in the bodies of animals in the form of the chemistry of digestion. Together with inhalation and exhalation, I digest the four types of food."],t.w)
B.L0=new A.d(B.c,["\u0938\u0930\u094d\u0935\u0938\u094d\u092f \u091a\u093e\u0939\u092e\u094d \u0939\u0943\u0926\u093f \u0938\u0928\u094d\u0928\u093f\u0935\u093f\u0937\u094d\u091f\u094b\n\u092e\u0924\u094d\u0924\u0903 \u0938\u094d\u092e\u0943\u0924\u093f\u0930\u094d\u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0905\u092a\u094b\u0939\u0928\u092e\u094d \u091a \u0964\n\u0935\u0947\u0926\u0948\u0936\u094d\u091a \u0938\u0930\u094d\u0935\u0948\u0930\u0939\u092e\u0947\u0935 \u0935\u0947\u0926\u094d\u092f\u094b\n\u0935\u0947\u0926\u093e\u0928\u094d\u0924\u0915\u0943\u0924\u094d \u0935\u0947\u0926 \u0935\u093f\u0926\u0947\u0935 \u091a\u093e\u0939\u092e\u094d \u0965 \u0967\u096b \u0965","I am at the heart of everything. Awareness, memory and the ability to reason come from Me. I alone am to be known from all the Vedas. I make the end of the Vedas and I am the One who knows the Vedas."],t.w)
B.R0=new A.d(B.c,["\u0926\u094d\u0935\u093e\u0935\u093f\u092e\u094c \u092a\u0941\u0930\u0941\u0937\u094c \u0932\u094b\u0915\u0947 \u0915\u094d\u0937\u0930\u0903 \u0905\u0915\u094d\u0937\u0930 \u090f\u0935 \u091a \u0964\n\u0915\u094d\u0937\u0930\u0903 \u0938\u0930\u094d\u0935\u093e\u0923\u093f \u092d\u0942\u0924\u093e\u0928\u093f \u0915\u0942\u091f\u0938\u094d\u0925\u0903 \u0905\u0915\u094d\u0937\u0930 \u0909\u091a\u094d\u092f\u0924\u0947 \u0965 \u0967\u096c \u0965","The people in My Universe are of two types - perishable and imperishable. All beings you see here are perishable. The ones who stay without deforming are said to be the imperishable."],t.w)
B.IR=new A.d(B.c,["\u0909\u0924\u094d\u0924\u092e\u0903 \u092a\u0941\u0930\u0941\u0937\u0938\u094d\u0924\u0941 \u0905\u0928\u094d\u092f\u0903 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u0947\u0924\u093f \u0909\u0926\u093e\u0939\u0943\u0924\u0903 \u0964\n\u092f\u094b \u0932\u094b\u0915\u0924\u094d\u0930\u092f\u092e\u094d \u0906\u0935\u093f\u0936\u094d\u092f \u092c\u093f\u092d\u0930\u094d\u0924\u093f \u0905\u0935\u094d\u092f\u092f\u0903 \u0908\u0936\u094d\u0935\u0930\u0903 \u0965 \u0967\u096d \u0965","However, the Supreme Person is another one. He is known as the Ultimate Self. He pervades the three domains and supports them. He never wears out. He is the Supreme Lord."],t.w)
B.OY=new A.d(B.c,["\u092f\u0938\u094d\u092e\u093e\u0924\u094d \u0915\u094d\u0937\u0930\u092e\u094d \u0905\u0924\u0940\u0924\u094b\u093d\u0939\u092e\u094d \u0905\u0915\u094d\u0937\u0930\u093e\u0924\u094d \u0905\u092a\u093f \u091a\u094b\u0924\u094d\u0924\u092e\u0903 \u0964\n\u0905\u0924\u094b\u093d\u0938\u094d\u092e\u093f \u0932\u094b\u0915\u0947 \u0935\u0947\u0926\u0947 \u091a \u092a\u094d\u0930\u0925\u093f\u0924\u0903 \u092a\u0941\u0930\u0941\u0937\u094b\u0924\u094d\u0924\u092e\u0903 \u0965 \u0967\u096e \u0965","As I am beyond the perishable and also superior to the imperishable, I am well-known in the world and in the Vedas as the Supreme Person."],t.w)
B.O9=new A.d(B.c,["\u092f\u094b \u092e\u093e\u092e\u094d \u090f\u0935\u092e\u094d \u0905\u0938\u092e\u094d\u092e\u0942\u0922\u0903 \u091c\u093e\u0928\u093e\u0924\u093f \u092a\u0941\u0930\u0941\u0937\u094b\u0924\u094d\u0924\u092e\u092e\u094d \u0964\n\u0938 \u0938\u0930\u094d\u0935\u0935\u093f\u0924\u094d \u092d\u091c\u0924\u093f \u092e\u093e\u092e\u094d \u0938\u0930\u094d\u0935\u092d\u093e\u0935\u0947\u0928 \u092d\u093e\u0930\u0924 \u0965 \u0967\u096f \u0965","Arjuna, the person who knows Me as the Supreme Person in this way without any doubts in mind - such a person knows everything and worships Me with all emotions."],t.w)
B.K7=new A.d(B.c,["\u0907\u0924\u093f \u0917\u0941\u0939\u094d\u092f\u0924\u092e\u092e\u094d \u0936\u093e\u0938\u094d\u0924\u094d\u0930\u092e\u094d \u0907\u0926\u092e\u094d \u0909\u0915\u094d\u0924\u092e\u094d \u092e\u092f\u093e \u0905\u0928\u0918 \u0964\n\u090f\u0924\u0924\u094d \u092c\u0941\u0926\u094d\u0927\u094d\u0935\u093e \u092c\u0941\u0926\u094d\u0927\u093f\u092e\u093e\u0928\u094d \u0938\u094d\u092f\u093e\u0924\u094d \u0915\u0943\u0924 \u0915\u0943\u0924\u094d\u092f\u0903 \u091a \u092d\u093e\u0930\u0924 \u0965 \u0968\u0966 \u0965","Flawless Arjuna, in this way, this knowledge, which is supremely concealed, has been spelt out by Me. Knowing this, you are endowed with intellect and shall have done everything there is to do."],t.w)
B.QB=new A.d(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u0905\u092d\u092f\u092e\u094d \u0938\u0924\u094d\u0924\u094d\u0935 \u0938\u092e\u094d\u0936\u0941\u0926\u094d\u0927\u093f\u0903 \u091c\u094d\u091e\u093e\u0928\u092f\u094b\u0917 \u0935\u094d\u092f\u0935\u0938\u094d\u0925\u093f\u0924\u093f\u0903 \u0964\n\u0926\u093e\u0928\u092e\u094d \u0926\u092e\u0903 \u091a \u092f\u091c\u094d\u091e\u0903 \u091a \u0938\u094d\u0935\u093e\u0927\u094d\u092f\u093e\u092f\u0903 \u0924\u092a \u0906\u0930\u094d\u091c\u0935\u092e\u094d \u0965 \u0967 \u0965\n\u0905\u0939\u093f\u0902\u0938\u093e \u0938\u0924\u094d\u092f\u092e\u094d \u0905\u0915\u094d\u0930\u094b\u0927\u0903 \u0924\u094d\u092f\u093e\u0917\u0903 \u0936\u093e\u0928\u094d\u0924\u093f\u0903 \u0905\u092a\u0948\u0936\u0941\u0928\u092e\u094d \u0964\n\u0926\u092f\u093e \u092d\u0942\u0924\u0947\u0937\u0941 \u0905\u0932\u094b\u0932\u0941\u092a\u094d\u0924\u094d\u0935\u092e\u094d \u092e\u093e\u0930\u094d\u0926\u0935\u092e\u094d \u0939\u094d\u0930\u0940\u0903 \u0905\u091a\u093e\u092a\u0932\u092e\u094d \u0965 \u0968 \u0965\n\u0924\u0947\u091c\u0903 \u0915\u094d\u0937\u092e\u093e \u0927\u0943\u0924\u093f\u0903 \u0936\u094c\u091a\u092e\u094d \u0905\u0926\u094d\u0930\u094b\u0939\u094b \u0928\u093e\u0924\u093f\u092e\u093e\u0928\u093f\u0924\u093e \u0964\n\u092d\u0935\u0928\u094d\u0924\u093f \u0938\u092e\u094d\u092a\u0926\u092e\u094d \u0926\u0948\u0935\u0940\u092e\u094d \u0905\u092d\u093f\u091c\u093e\u0924\u0938\u094d\u092f \u092d\u093e\u0930\u0924 \u0965 \u0969 \u0965","The Lord said - Arjuna, the characteristics of a person who is born into the Lord's principles are: Freedom from fear; A clear mind; Settled in the knowledge of the Self; Generosity; Control over the organs; Worship of the Lord; Recitation of the scriptures; Dedication of thought into performance; Consistency in thought, speech and action; Intolerance towards violence; Saying it 'as it is', in a way that's beneficial; Freedom from anger; Leaving things that don\u2019t benefit the Self; Being content with the Self; Not speaking ill of others; Compassion towards all beings; Without attachments in material subjects; Without being harsh; Modesty; Unwavering; The brilliance of leadership; Forgiveness; Resolve; Cleanliness; Being without putting another at a disadvantage; Being without inappropriate pride."],t.w)
B.R9=new A.d(B.c,["\u0921\u092e\u094d\u092d\u094b \u0926\u0930\u094d\u092a\u0903 \u0905\u0924\u093f\u092e\u093e\u0928\u0903 \u091a \u0915\u094d\u0930\u094b\u0927\u0903 \u092a\u093e\u0930\u0941\u0937\u094d\u092f\u092e\u0947\u0935 \u091a \u0964\n\u0905\u091c\u094d\u091e\u093e\u0928\u092e\u094d \u091a\u093e\u092d\u093f\u091c\u093e\u0924\u0938\u094d\u092f \u092a\u093e\u0930\u094d\u0925 \u0938\u092e\u094d\u092a\u0926\u092e\u094d \u0906\u0938\u0941\u0930\u0940\u092e\u094d \u0965 \u096a \u0965","Arjuna, a person with an attitude of non-compliance of the Lord's instructions has the following characteristics: Being righteous just to show-off; Intoxicated by the experience of material attractions; Stuck in self-esteem; Anger; Harshness; and Ignorance."],t.w)
B.O7=new A.d(B.c,["\u0926\u0948\u0935\u0940 \u0938\u092e\u094d\u092a\u0924\u094d \u0935\u093f\u092e\u094b\u0915\u094d\u0937\u093e\u092f \u0928\u092c\u0928\u094d\u0927\u0928\u093e\u092f\u093e\u0938\u0941\u0930\u0940 \u092e\u0924\u093e \u0964","Compliance to the Lord's instructions is an asset for liberation . The path of disregarding for these instructions is to bind a person in the material world."],t.w)
B.Qw=new A.d(B.c,["\u092e\u093e \u0936\u0941\u091a\u0903 \u0938\u092e\u094d\u092a\u0926\u092e\u094d \u0926\u0948\u0935\u0940\u092e\u094d \u0905\u092d\u093f\u091c\u093e\u0924\u094b\u093d\u0938\u093f \u092a\u093e\u0928\u094d\u0921\u0935 \u0965 \u096b \u0965","Arjuna, don't worry. You are born with the property of complying to My instructions ."],t.w)
