B.Q_=new A.d(B.c,["\u0928 \u0926\u094d\u0935\u0947\u0937\u094d\u091f\u093f \u0905\u0915\u0941\u0936\u0932\u092e\u094d \u0915\u0930\u094d\u092e \u0915\u0941\u0936\u0932\u0947 \u0928 \u0905\u0928\u0941\u0937\u091c\u094d\u091c\u0924\u0947 \u0964\n\u0924\u094d\u092f\u093e\u0917\u0940 \u0938\u0924\u094d\u0924\u094d\u0935 \u0938\u092e\u093e\u0935\u093f\u0937\u094d\u091f\u094b \u092e\u0947\u0927\u093e\u0935\u0940 \u091b\u093f\u0928\u094d\u0928 \u0938\u092e\u094d\u0936\u092f\u0903 \u0965 \u0967\u0966 \u0965","A person who lets go in this way enters the quality of sattva , gains intelligence and loses all doubt. He does not loath work that makes him unhappy, neither does he cling to happiness."],t.w)
B.P2=new A.d(B.c,["\u0928 \u0939\u093f \u0926\u0947\u0939\u092d\u0943\u0924\u093e \u0936\u0915\u094d\u092f\u092e\u094d \u0924\u094d\u092f\u0915\u094d\u0924\u0941\u092e\u094d \u0915\u0930\u094d\u092e\u093e\u0923\u093f \u0905\u0936\u0947\u0937\u0924\u0903 \u0964\n\u092f\u0938\u094d\u0924\u0941 \u0915\u0930\u094d\u092e \u092b\u0932 \u0924\u094d\u092f\u093e\u0917\u0940 \u0938 \u0924\u094d\u092f\u093e\u0917\u0940 \u0907\u0924\u094d\u092f\u092d\u093f\u0927\u0940\u092f\u0924\u0947 \u0965 \u0967\u0967 \u0965","Indeed, it's not possible for a person having a body to give up all actions without exception. On the other hand, a person who leaves the outcome of his action is known as the one who has let-go."],t.w)
B.Oz=new A.d(B.c,["\u0905\u0928\u093f\u0937\u094d\u091f\u092e\u094d \u0907\u0937\u094d\u091f\u092e\u094d \u092e\u093f\u0936\u094d\u0930\u092e\u094d \u091a \u0924\u094d\u0930\u093f\u0935\u093f\u0927\u092e\u094d \u0915\u0930\u094d\u092e\u0923\u0903 \u092b\u0932\u092e\u094d \u0964\n\u092d\u0935\u0924\u093f \u0905\u0924\u094d\u092f\u093e\u0917\u093f\u0928\u093e\u092e\u094d \u092a\u094d\u0930\u0947\u0924\u094d\u092f \u0928 \u0924\u0941 \u0938\u0902\u0928\u094d\u092f\u093e\u0938\u093f\u0928\u093e\u092e\u094d \u0915\u094d\u0935\u091a\u093f\u0924\u094d \u0965 \u0967\u0968 \u0965","The outcome of actions will happen in three ways to those who haven't let-go : undesirable, desirable and a mix of both. However, none of these happen to those who have let-go ."],t.w)
B.RU=new A.d(B.c,["\u092a\u0928\u094d\u091a\u0948\u0924\u093e\u0928\u093f \u092e\u0939\u093e\u092c\u093e\u0939\u094b \u0915\u093e\u0930\u0923\u093e\u0928\u093f \u0928\u093f\u092c\u094b\u0927 \u092e\u0947 \u0964\n\u0938\u093e\u0902\u0916\u094d\u092f\u0947 \u0915\u0943\u0924\u093e\u0928\u094d\u0924\u0947 \u092a\u094d\u0930\u094b\u0915\u094d\u0924\u093e\u0928\u093f \u0938\u093f\u0926\u094d\u0927\u092f\u0947 \u0938\u0930\u094d\u0935\u0915\u0930\u094d\u092e\u0923\u093e\u092e\u094d \u0965 \u0967\u0969 \u0965","Arjuna, hear and know these five causes for the achievement of all actions from Me. They are specified in the reflections of the Upanishads."],t.w)
B.JM=new A.d(B.c,["\u0905\u0927\u093f\u0937\u094d\u0920\u093e\u0928\u092e\u094d \u0924\u0925\u093e \u0915\u0930\u094d\u0924\u093e \u0915\u0930\u0923\u092e\u094d \u091a \u092a\u0943\u0925\u0915\u094d \u0935\u093f\u0927\u092e\u094d \u0964\n\u0935\u093f\u0935\u093f\u0927\u093e\u0903 \u091a \u092a\u0943\u0925\u0915\u094d \u091a\u0947\u0937\u094d\u091f\u093e \u0926\u0948\u0935\u092e\u094d \u091a\u0948\u0935\u093e\u0924\u094d\u0930 \u092a\u0928\u094d\u091a\u092e\u092e\u094d \u0965 \u0967\u096a \u0965\n\u0936\u0930\u0940\u0930 \u0935\u093e\u0915\u094d \u092e\u0928\u094b\u092d\u093f\u0903 \u092f\u0924\u094d \u0915\u0930\u094d\u092e \u092a\u094d\u0930\u093e\u0930\u092d\u0924\u0947 \u0928\u0930\u0903 \u0964\n\u0928\u094d\u092f\u093e\u092f\u094d\u092f\u092e\u094d \u0935\u093e \u0935\u093f\u092a\u0930\u0940\u0924\u092e\u094d \u0935\u093e \u092a\u0928\u094d\u091a\u0948\u0924\u0947 \u0924\u0938\u094d\u092f \u0939\u0947\u0924\u0935\u0903 \u0965 \u0967\u096b \u0965","The base, along with the doer, together with the different organs and the various activities - in this field, the fifth one is The Divine. They are the five causes of any action that a human can initiate with the body, speech, or the mind - whether just or unjust."],t.w)
B.QW=new A.d(B.c,["\u0924\u0924\u094d\u0930\u0948\u0935\u092e\u094d \u0938\u0924\u093f \u0915\u0930\u094d\u0924\u093e\u0930\u092e\u094d \u0906\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u0915\u0947\u0935\u0932\u092e\u094d \u0924\u0941 \u092f\u0903 \u0964\n\u092a\u0936\u094d\u092f\u0924\u093f \u0905\u0915\u0943\u0924\u092c\u0941\u0926\u094d\u0927\u093f\u0924\u094d\u0935\u093e\u0924\u094d \u0928 \u0938 \u092a\u0936\u094d\u092f\u0924\u093f \u0926\u0941\u0930\u094d\u092e\u0924\u093f\u0903 \u0965 \u0967\u096c \u0965","This being the case, the one who still considers himself as the sole doer here is ignorant. This person does not see things in their true form due to an immature intellect."],t.w)
B.NS=new A.d(B.c,["\u092f\u0938\u094d\u092f \u0928\u093e\u0939\u0902\u0915\u0943\u0924\u094b \u092d\u093e\u0935\u094b \u092c\u0941\u0926\u094d\u0927\u093f\u0903 \u092f\u0938\u094d\u092f \u0928 \u0932\u093f\u092a\u094d\u092f\u0924\u0947 \u0964\n\u0939\u0924\u094d\u0935\u093e\u093d\u092a\u093f \u0938 \u0907\u092e\u093e\u0928\u094d \u0932\u094b\u0915\u093e\u0928\u094d \u0928 \u0939\u0928\u094d\u0924\u093f \u0928 \u0928\u093f\u092c\u0927\u094d\u092f\u0924\u0947 \u0965 \u0967\u096d \u0965","The person whose belief is that he's not the one who makes things happen, the one whose intellect stays free of the burden of attachments and doesn't get trapped - Even when he kills all these people, he doesn't kill."],t.w)
B.QZ=new A.d(B.c,["\u091c\u094d\u091e\u093e\u0928\u092e\u094d \u091c\u094d\u091e\u0947\u092f\u092e\u094d \u092a\u0930\u093f\u091c\u094d\u091e\u093e\u0924\u093e \u0924\u094d\u0930\u093f\u0935\u093f\u0927\u093e \u0915\u0930\u094d\u092e \u091a\u094b\u0926\u0928\u093e \u0964\n\u0915\u0930\u0923\u092e\u094d \u0915\u0930\u094d\u092e \u0915\u0930\u094d\u0924\u0947\u0924\u093f \u0924\u094d\u0930\u093f\u0935\u093f\u0927\u0903 \u0915\u0930\u094d\u092e \u0938\u0902\u0917\u094d\u0930\u0939\u0903 \u0965 \u0967\u096e \u0965","Knowledge, that which has to be perceived and the one who recognizes are the three sources of initiative for any action. The instruments, the activity itself and the one who performs the activity are the three types of things that put the action together."],t.w)
B.K4=new A.d(B.c,["\u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0915\u0930\u094d\u092e \u091a \u0915\u0930\u094d\u0924\u093e \u091a \u0924\u094d\u0930\u093f\u0927\u0948\u0935 \u0917\u0941\u0923\u092d\u0947\u0926\u0924\u0903 \u0964\n\u092a\u094d\u0930\u094b\u091a\u094d\u092f\u0924\u0947 \u0917\u0941\u0923 \u0938\u0902\u0916\u094d\u092f\u093e\u0928\u0947 \u092f\u0925\u093e\u0935\u0924\u094d \u0936\u0943\u0923\u0941 \u0924\u093e\u0928\u094d\u092f\u092a\u093f \u0965 \u0967\u096f \u0965","It is said that knowledge, action and the doer are of three types each. They are enumerated in the three qualities . They go by the distinctions of those qualities . Listen to the genuine nature of that knowledge, action and the doer as well."],t.w)
B.Js=new A.d(B.c,["\u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u0947\u0937\u0941 \u092f\u0947\u0928\u0948\u0915\u092e\u094d \u092d\u093e\u0935\u092e\u094d \u0905\u0935\u094d\u092f\u092f\u092e\u094d \u0908\u0915\u094d\u0937\u0924\u0947 \u0964\n\u0905\u0935\u093f\u092d\u0915\u094d\u0924\u092e\u094d \u0935\u093f\u092d\u0915\u094d\u0924\u0947\u0937\u0941 \u0924\u0924\u094d \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u0938\u093e\u0924\u094d\u0935\u093f\u0915\u092e\u094d \u0965 \u0968\u0966 \u0965","The awareness by which the same attitude is expressed towards all beings, considering them unchanging and uniform even in their variety - know such knowledge to be in the quality of sattva ."],t.w)
B.MW=new A.d(B.c,["\u092a\u0943\u0925\u0915\u094d\u0924\u094d\u0935\u0947\u0928 \u0924\u0941 \u092f\u0924\u094d \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0928\u093e\u0928\u093e\u092d\u093e\u0935\u093e\u0928\u094d \u092a\u0943\u0925\u0915\u094d \u0935\u093f\u0927\u093e\u0928\u094d \u0964\n\u0935\u0947\u0924\u094d\u0924\u093f \u0938\u0930\u094d\u0935\u0947\u0937\u0941 \u092d\u0942\u0924\u0947\u0937\u0941 \u0924\u0924\u094d \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u0930\u093e\u091c\u0938\u092e\u094d \u0965 \u0968\u0967 \u0965","On the other hand, there's knowledge, which recognizes different attitudes among all the different types of beings, due to their variety. Know that such knowledge is in the quality of rajas ."],t.w)
B.Ow=new A.d(B.c,["\u092f\u0924\u094d \u0924\u0941 \u0915\u0943\u0924\u094d\u0938\u094d\u0928\u0935\u0924\u094d \u090f\u0915\u0938\u094d\u092e\u093f\u0928\u094d \u0915\u093e\u0930\u094d\u092f\u0947 \u0938\u0915\u094d\u0924\u092e\u094d \u0905\u0939\u0947\u0924\u0941\u0915\u092e\u094d \u0964\n\u0905\u0924\u0924\u094d\u0935\u093e\u0930\u094d\u0925\u0935\u0924\u094d \u0905\u0932\u094d\u092a\u092e\u094d \u091a \u0924\u0924\u094d \u0924\u093e\u092e\u0938\u092e\u094d \u0909\u0926\u093e\u0939\u0943\u0924\u092e\u094d \u0965  \u0968\u0968 \u0965","There is yet another category that gets preoccupied in some isolated work as though it was everything, without any basis. It is not based on any concept, having very little value. That is said to be in the quality of tamas ."],t.w)
B.PI=new A.d(B.c,["\u0928\u093f\u092f\u0924\u092e\u094d \u0938\u0902\u0917\u0930\u0939\u093f\u0924\u092e\u094d \u0905\u0930\u093e\u0917 \u0926\u094d\u0935\u0947\u0937\u0924\u0903 \u0915\u0943\u0924\u092e\u094d \u0964\n\u0905\u092b\u0932 \u092a\u094d\u0930\u0947\u092a\u094d\u0938\u0941\u0928\u093e \u0915\u0930\u094d\u092e \u092f\u0924\u094d \u0924\u0924\u094d \u0938\u093e\u0924\u094d\u0935\u093f\u0915\u092e\u094d \u0909\u091a\u094d\u092f\u0924\u0947 \u0965 \u0968\u0969 \u0965","Activity that's carried out with self-governance, free from attachment, without desire or hatred by a person who is not driven by the outcome - such action is said to be in the quality of sattva ."],t.w)
B.IS=new A.d(B.c,["\u092f\u0924\u094d \u0924\u0941 \u0915\u093e\u092e\u0947\u092a\u094d\u0938\u0941\u0928\u093e \u0915\u0930\u094d\u092e \u0938\u093e\u0939\u0902\u0915\u093e\u0930\u0947\u0923 \u0935\u093e \u092a\u0941\u0928\u0903 \u0964\n\u0915\u094d\u0930\u093f\u092f\u0924\u0947 \u092c\u0939\u0941\u0932\u093e\u092f\u093e\u0938\u092e\u094d \u0924\u0924\u094d \u0930\u093e\u091c\u0938\u092e\u094d \u0909\u0926\u093e\u0939\u0943\u0924\u092e\u094d \u0965 \u0968\u096a \u0965","On the other hand, work that\u2019s done with expectation to fulfil desires, or again, with the misconception of making things happen, performed with great strain - such action is said to be in the quality of rajas ."],t.w)
B.Jd=new A.d(B.c,["\u0905\u0928\u0941\u092c\u0928\u094d\u0927\u092e\u094d \u0915\u094d\u0937\u092f\u092e\u094d \u0939\u093f\u0902\u0938\u093e\u092e\u094d \u0905\u0928\u0935\u0947\u0915\u094d\u0937\u094d\u092f \u091a \u092a\u094c\u0930\u0941\u0937\u092e\u094d \u0964\n\u092e\u094b\u0939\u093e\u0924\u094d \u0906\u0930\u092d\u094d\u092f\u0924\u0947 \u0915\u0930\u094d\u092e \u092f\u0924\u094d \u0924\u0924\u094d \u0924\u093e\u092e\u0938\u092e\u094d \u0909\u091a\u094d\u092f\u0924\u0947 \u0965 \u0968\u096b \u0965","Work that is started out of misconception, without considering the bondage it brings, the associated expense, the distress and our capability - that work is said to be in the quality of tamas ."],t.w)
B.Jm=new A.d(B.c,["\u092e\u0941\u0915\u094d\u0924 \u0938\u0902\u0917\u0903 \u0905\u0928\u0939\u092e\u094d\u0935\u093e\u0926\u0940 \u0927\u0943\u0924\u093f \u0909\u0924\u094d\u0938\u093e\u0939 \u0938\u092e\u0928\u094d\u0935\u093f\u0924\u0903 \u0964\n\u0938\u093f\u0926\u094d\u0927\u094d\u092f\u0938\u093f\u0926\u094d\u0927\u094d\u092f\u094b\u0903 \u0928\u093f\u0930\u094d\u0935\u093f\u0915\u093e\u0930\u0903 \u0915\u0930\u094d\u0924\u093e \u0938\u093e\u0924\u094d\u0935\u093f\u0915 \u0909\u091a\u094d\u092f\u0924\u0947 \u0965  \u0968\u096c \u0965","A person who is free of attachment, who doesn't claim to make things happen is endowed with resolve and enthusiasm. Unmoved among achievements and failures, such a doer is said to be in the quality of sattva ."],t.w)
B.PX=new A.d(B.c,["\u0930\u093e\u0917\u0940 \u0915\u0930\u094d\u092e\u092b\u0932 \u092a\u094d\u0930\u0947\u092a\u094d\u0938\u0941\u0903 \u0932\u0941\u092c\u094d\u0927\u094b \u0939\u093f\u0902\u0938\u093e\u0924\u094d\u092e\u0915\u0903 \u0905\u0936\u0941\u091a\u093f \u0964\n\u0939\u0930\u094d\u0937 \u0936\u094b\u0915\u093e\u0928\u094d\u0935\u093f\u0924\u0903 \u0915\u0930\u094d\u0924\u093e \u0930\u093e\u091c\u0938\u0903 \u092a\u0930\u093f\u0915\u0940\u0930\u094d\u0924\u093f\u0924\u0903 \u0965 \u0968\u096d \u0965","A passionate person is anxious to secure the outcome of activity. He is stingy and troubles others with his foul nature. He is a doer defined by happiness and sorrow. Such a person is said to be in the quality of rajas ."],t.w)
B.RQ=new A.d(B.c,["\u0905\u092f\u0941\u0915\u094d\u0924\u0903 \u092a\u094d\u0930\u093e\u0915\u0943\u0924\u0903 \u0938\u094d\u0924\u092c\u094d\u0927\u0903 \u0936\u0920\u094b \u0928\u0948\u0915\u0943\u0924\u093f\u0915\u094b\u093d\u0932\u0938\u0903 \u0964\n\u0935\u093f\u0937\u093e\u0926\u0940 \u0926\u0940\u0930\u094d\u0918 \u0938\u0942\u0924\u094d\u0930\u0940 \u091a \u0915\u0930\u094d\u0924\u093e \u0924\u093e\u092e\u0938 \u0909\u091a\u094d\u092f\u0924\u0947 \u0965 \u0968\u096e \u0965","A person who doesn't apply himself is ordinary, stiff and pretentious. He is offensive, vile, lazy, dejected and spins a long yarn. Such a doer is said to be in the quality of tamas ."],t.w)
B.Q6=new A.d(B.c,["\u092c\u0941\u0926\u094d\u0927\u0947\u0903 \u092d\u0947\u0926\u092e\u094d \u0927\u0943\u0925\u0947\u0903 \u091a\u0948\u0935 \u0917\u0941\u0923\u0924\u0903 \u0924\u094d\u0930\u093f\u0935\u093f\u0927\u092e\u094d \u0936\u0943\u0923\u0941 \u0964\n\u092a\u094d\u0930\u094b\u091a\u094d\u092f\u092e\u093e\u0928\u092e\u094d \u0905\u0936\u0947\u0937\u0947\u0923 \u092a\u0943\u0925\u0915\u094d\u0924\u094d\u0935\u0947\u0928 \u0927\u0928\u0928\u094d\u091c\u092f \u0965 \u0968\u096f \u0965","Arjuna, listen to the three types of intellect and the three types of resolve. They are distinguished by the three qualities . Each of them will now be described in completeness."],t.w)
B.LH=new A.d(B.c,["\u092a\u094d\u0930\u0935\u0943\u0924\u094d\u0924\u093f\u092e\u094d \u091a \u0928\u093f\u0935\u0943\u0924\u094d\u0924\u093f\u092e\u094d \u091a \u0915\u093e\u0930\u094d\u092f\u093e\u0915\u093e\u0930\u094d\u092f\u0947 \u092d\u092f\u093e\u092d\u092f\u0947 \u0964\n\u092c\u0928\u094d\u0927\u092e\u094d \u092e\u094b\u0915\u094d\u0937\u092e\u094d \u091a \u092f\u093e \u0935\u0947\u0924\u094d\u0924\u093f \u092c\u0941\u0926\u094d\u0927\u093f\u0903 \u0938\u093e \u092a\u093e\u0930\u094d\u0925 \u0938\u093e\u0924\u094d\u0935\u093f\u0915\u0940 \u0965 \u0969\u0966 \u0965","Arjuna, the intellect , which is in sattva knows the activities of this world and the tranquility of liberation. It knows what's to be done, what's not to be done. It knows about being afraid and being free from fear. It knows bondage and liberty."],t.w)
